(233, 1, '2013-09-08 21:42:35', '2013-09-09 00:42:35', 'Edificar Real Estate Office is situated in Mina Clavero, was founded in September 2013. The area of influence is Traslasierra Valley, Córdoba Province.\r\nEfficiency and honesty are prioritized in our work. The confidentiality in consultations and professional diligence lead us to meet the expectations of every client. With our hard work, we wish fine a solution for every problem. Our best publicity is the feedback from our customers.\r\n\r\nEdificar Real Estate Office is owned by R. Esteban Urús Real Estate Broker M.P. 4448 CPCPI.\r\n<small>Legal advice: Dr. Guillermo Dutto. Lawyer. MP 1-31205.</small>\r\n<blockquote>R. Esteban Urús was born in Saladillo City, Buenos Aires Province, in 1.980. In 2.003 moved to Villa Cura Brochero. Since 2.006 worked in others real estate offices. He study in Inst. Cervantes and Universidad Siglo 21. Since 2.004 is a member of the Chamber of Commerce and Tourism of Villa Cura Brochero; and between 2.011 and 2.013 held the position of Vice-president. He lives in Traslasierra with his family, wife and two little boys.</blockquote>', 'About us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2013-10-05 10:43:01', '2013-10-05 13:43:01', '', 0, 'http://localhost/28._InmobiliariaEsteban/en/?page_id=233', 0, 'page', '', 0),
