(290, 1, '2013-09-12 18:43:07', '2013-09-12 21:43:07', 'In Villa Cura Brochero you can visit the Centenario Square, with the Priest Brochero´s monument, in front of the neogothic style Church, where are the remains of priest.\r\n<strong>You must visit this place.</strong>\r\nThe actual Brochero´s museum was a house of spiritual exercises built by the priest. Main rooms have many things which rebuilt his life and work. There´s also a sector that recreates customs of people of this zone at late 19th century and another that is dedicated to “Comechingones”. Near from there is the house where the priest Brochero lived his last years, sick and prostrated. This house shows an exhibition of antique furniture that he used and his courtyard today is a museum too.\r\nAnother thing you can do is to visit some of the churches in this area that he built.', 'Religious'' Circuit', '', 'publish', 'closed', 'closed', '', 'religious-circuit', '', '', '2013-10-09 11:24:33', '2013-10-09 14:24:33', '', 0, 'http://localhost/28._InmobiliariaEsteban/en/?page_id=290', 0, 'page', '', 0),
(292, 1, '2013-09-12 18:44:24', '2013-09-12 21:44:24', 'This road was the first way to cross the hills between Traslasierra Valley and Córdoba City.\r\nThis is a magnificent work done by the Priest Brochero. When you traverse this road you have the luck to contact with native nature and beautiful landscapes of the place.\r\n\r\n<strong>The crafts of the zone.</strong>\r\nYou can visit workshops where there are ceramics at sold and there’s also handmade loom fabrics. Along the road there’re about twenty families that live exposing their variety of pieces on their own workshops. They use different techniques such as handicraft and manufactured work that were transmitted from generation to generation.', 'Craftsmen´s Road', '', 'publish', 'closed', 'closed', '', 'craftsmens-road', '', '', '2013-10-27 10:34:00', '2013-10-27 13:34:00', '', 0, 'http://localhost/28._InmobiliariaEsteban/en/?page_id=292', 0, 'page', '', 0),
(294, 1, '2013-09-12 18:45:27', '2013-09-12 21:45:27', 'If you drive from Mina Clavero to the Vineyard Dam you will go through Arroyo de los Patos town and you will be able to see the beautiful golden beaches of Los Sauces River. When you arrive to Nono town you will be able to swim in Río Chico or in Paso de las Tropas. Nearby there is a really interesting museum that is well-known for its multifaceted exposition: The Rocsen Museum.\r\n\r\nIf you go on driving you will arrive at Los Hornillos town, the provincial capital of ecotourism and microclimate that it’s a beautiful village down the mountains. Finally when you’re about to arrive to the Dam you will cross through Los Pozos town where you have to turn right to reach your destination. It has 102 meters of height feature that make it one of the deepest dams of South America.\r\nIn the journey you can visit a goat cheese factory and another that produces olive oil, without forgetting some cookies homemade factories which are famous on the zone.', 'Vineyard dam´s Circuit', '', 'publish', 'closed', 'closed', '', 'vineyard-dams-circuit', '', '', '2013-10-06 00:14:25', '2013-10-06 03:14:25', '', 0, 'http://localhost/28._InmobiliariaEsteban/en/?page_id=294', 0, 'page', '', 0),
(296, 1, '2013-09-12 18:48:14', '2013-09-12 21:48:14', 'A 50 km. away from the North West from Villa Cura Brochero and Mina Clavero, driving the 15 route, arrive to Taninga town, there are Mirador, volcano Yerba Buena, the access to this interesting tour. Then cross Las Palmas place, with a chapel built between 1.689 and 1.736 with simple lines, with interesting imagery and ornaments.\r\n\r\nGorge of Mermela, the last point of the tour, where are the tunnels, from where you can see La Rioja´s plain and the Chancaní Valley.', 'Tunnels'' Circuit', '', 'publish', 'closed', 'closed', '', 'circuit-tunnels', '', '', '2013-09-25 12:38:54', '2013-09-25 15:38:54', '', 0, 'http://localhost/28._InmobiliariaEsteban/en/?page_id=296', 0, 'page', '', 0),
(298, 1, '2013-09-12 18:50:11', '2013-09-12 21:50:11', 'In this tour, driving along the 34 Prov. Route, you can see all the valley from natural viewpoints. River Los Sauces: place with excellent spas, the rock chapel; you can practice walking and paragliding.\r\nSource of the River Mina Clavero: walking 200 meters from the route, you will find an impressive waterfall. The condor: the highest point of Pampa de Achala. “Quebrada del Condorito” national park. It is accessible walking or cycling. Here you can see condors in the wild.', 'High Peaks'' Road', '', 'publish', 'closed', 'closed', '', 'high-peaks-road', '', '', '2013-10-05 10:29:09', '2013-10-05 13:29:09', '', 0, 'http://localhost/28._InmobiliariaEsteban/en/?page_id=298', 0, 'page', '', 0),
(300, 1, '2013-09-12 18:51:24', '2013-09-12 21:51:24', 'This hill is 2.889 meters above sea level. It is the highest of Córdoba. Walk to the top delayed about nine hours.', 'Champaquí Hill', '', 'publish', 'closed', 'closed', '', 'champaqui-hill', '', '', '2013-10-09 09:09:21', '2013-10-09 12:09:21', '', 0, 'http://localhost/28._InmobiliariaEsteban/en/?page_id=300', 0, 'page', '', 0),
(302, 1, '2013-09-12 18:53:45', '2013-09-12 21:53:45', 'Enjoy Traslasierra in the rivers! Some natural spas in Mina Clavero: “Pileta Municipal Central”, “Nido de Aguila”, “La Toma”, “Baño de los Dioses”, “Niña Paula”, “Abuela Teresa”, “Río Hondo”, etc.\r\n\r\nVilla Cura Brochero´s natural spas (rivers Panaholma and Los Sauces):”Los Cedros”, “Costanera Norte”, “Balneario Municipal”, “Balneario El Pocito”, “Los Cajones”, “Los Elefantes”, etc. Nono: “Los Remansos”, “Paso de las tropas”, “El Vado”.', 'Natural Spas in rivers', '', 'publish', 'closed', 'closed', '', 'natural-spas-in-rivers', '', '', '2013-09-24 16:35:44', '2013-09-24 19:35:44', '', 0, 'http://localhost/28._InmobiliariaEsteban/en/?page_id=302', 0, 'page', '', 0),
