(343, 1, '2013-09-18 19:48:59', '2013-09-18 22:48:59', 'It´s situated in a family neighbourhood, 400 metres from Centenario Square.\r\n\r\nThis piece of land is situated 100 metres from supermarket and from the 15 Prov. Route. Here´re all the services of the town: Water, Energy, Telephone, Internet, etc.\r\n\r\nThe land of 231m2 could be used to build a house or a shop.\r\n\r\nIf you are looking for a quiet place to live, here´s is an option.\r\n\r\n&nbsp;\r\n\r\n<span style="text-decoration: underline;">Price</span>: <strong>$ 160.000.- (PESOS HUNDRED and SIXTY THOUSAND).</strong>\r\n\r\n&nbsp;\r\n\r\nReal Estate Commission: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. R. Esteban Urús.\r\n\r\nMat. Nº4448.', 'T01 - Land of 231 m2 in V. Cura Brochero', '', 'publish', 'closed', 'open', '', 't01-land-of-231-m2-in-v-cura-brochero', '', '', '2013-09-18 19:53:58', '2013-09-18 22:53:58', '', 0, 'http://www.webmoderna.com.ar/edificarinmobiliaria/en/?p=343', 0, 'post', '', 0),
