(355, 1, '2013-09-21 20:01:57', '2013-09-21 23:01:57', '<p style="text-align: justify;">It´s situated near Ciénaga de Allende, 22 km. from Mina Clavero. There are a stream, field and hills, with native vegetation.\r\nThe field is driving to the west 22 kms. About 141 hectares are divided in two parts by a road. To the north are about 32 hectares, with agricultural sector, a stream and water well. The south’ part is about 109 hectares with hills, native vegetation and grass. It has a little brook too. The electric network is about 1.800 metres of distance from the field. The perimeter is wired and needs preservation.\r\nThis field allows raising cattle and have a quiet life.</p>\r\n<p style="text-align: justify;">Precio de Venta:\r\n141 Hec. x $6.500.- each\r\n\r\nReal Estate Commission: 3 %</p>\r\n<p style="text-align: justify;">Tel.03544-15431582\r\nCorr. Inmb. R. Esteban Urús.\r\nMat. Nº4448.</p>', 'C01 - 141 Hectares in Ciénaga de Allende', '', 'publish', 'closed', 'closed', '', 'c01-180-hectares-cienaga-allende', '', '', '2014-08-15 11:33:09', '2014-08-15 14:33:09', '', 0, 'http://www.webmoderna.com.ar/edificarinmobiliaria/en/?p=355', 0, 'post', '', 0),
