(372, 1, '2013-09-23 12:11:29', '2013-09-23 15:11:29', 'The priest was recognized for his work in Traslasierra. A crowd attended the celebration. Mass was presided over by Cardinal Angelo Amato.\r\n\r\nPeople arrived to Villa Cura Brochero from different provinces, and other cities of Córdoba. About 150.000 persons came and enjoy this event. Pope Francis sent a letter and a beautiful gift, a golden bell for the church. Religious tourism is another reason to visit Traslasierra, and Cura Brochero Village.', 'The priest José Gabriel Brochero is blessed in Córdoba', '', 'publish', 'closed', 'closed', '', 'the-priest-jose-gabriel-brochero-is-blessed-in-cordoba', '', '', '2013-09-23 12:11:29', '2013-09-23 15:11:29', '', 0, 'http://www.webmoderna.com.ar/edificarinmobiliaria/en/?p=372', 0, 'post', '', 0),
