(381, 1, '2013-09-26 16:49:30', '2013-09-26 19:49:30', 'This premium house has very good design. The residential and quiet neighborhood is between Mina Clavero and Villa Cura Brochero commercial center.\r\n\r\n&nbsp;\r\n\r\nIt´s situated 600 mtrs. from Mina Clavero downtown, and 1200 mtrs. from V. Cura Brochero central square. The land is 864 m2.\r\n\r\nThe ground floor of the house has a large dining room with kitchen, a small bathroom, and a bedroom with bathroom in suite. Ground floor is 71 m2. Also has garage is for two cars.\r\n\r\nUpstairs has three bedrooms, another bathroom and a balcony with a wonderful panoramic view of the high picks.\r\n\r\nThe house has all the services of the village  and title deed.\r\n\r\nIt´s a interesting option to buy a comfortable house in Brochero´s land.\r\n\r\n<span style="text-decoration: underline;"> </span>\r\n\r\n<span style="text-decoration: underline;">Price</span>: <strong>U$S 180.000.- (PESOS ONE HUNDRED and EIGHTY THOUSAND AMERICAN DOLLARS).</strong>\r\n\r\n<strong> </strong>\r\n\r\nTel.03544-15431582\r\n\r\nC.I. Esteban Urús.\r\n\r\nM.P. 4448.', 'V01- House with 4 bedrooms in V. Cura Brochero', '', 'publish', 'closed', 'open', '', 'v01-house-with-4-bedrooms-in-v-cura-brochero', '', '', '2013-09-26 16:49:30', '2013-09-26 19:49:30', '', 0, 'http://edificarinmobiliaria.com/en/?p=381', 0, 'post', '', 0),
