(425, 1, '2013-10-06 23:15:20', '2013-10-07 02:15:20', 'The lands are situated in a place call “El Salado”, about 1.200 metres from Panaholma´s central square. Beautiful view of a little river and the high picks.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nThe neighbourhood is very quiet and there´re a few neighbours, who live there all the year. The area is rural, with native trees. Eight land sell, about between 826 m2 and 1853 m2. Near the place, cross trough a little river, which creates a beautiful view.\r\n\r\n&nbsp;\r\n\r\nThese are interesting options to build a house to rent or live in a save and quiet place, near Panaholma and about 18 km from Mina Clavero.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<div>\r\n\r\nLAND               AREA                                                    PRICE\r\n\r\n</div>\r\n1                   1.031.-     m2                                       $ 75.000.-\r\n\r\n2                   1.028.-     m2                                       SOLD\r\n\r\n3                      971.-     m2                                        SOLD\r\n\r\n4                      826.-     m2                                        SOLD\r\n\r\n5                   1.853.-     m2                                       $ 99.000.-\r\n\r\n6                   1.111,50 m2                                        $ 75.000.-\r\n\r\n7                   1.106,40 m2                                        $ 83.000.-\r\n\r\n8                      987.-     m2                                       $ 75.000.-\r\n\r\n9                   1.111,50 m2                                         SOLD\r\n\r\n&nbsp;\r\n\r\nBrokerage fee: 5%\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<b> </b>', 'T02 Lands in Panaholma. Quiet place.', '', 'publish', 'closed', 'open', '', 't02-lands-panaholma-quiet-place', '', '', '2015-02-23 12:13:44', '2015-02-23 15:13:44', '', 0, 'http://edificarinmobiliaria.com/en/?p=425', 0, 'post', '', 0),
