(438, 1, '2013-10-13 10:51:30', '2013-10-13 13:51:30', 'The land is situated on the road between Panaholma and “Los Morteritos”, about 150 metres from the river, in a place with a sandy; and is 1.800 metres from the square. It has 28 metres front and 45 metres long.\r\n\r\nThe ground is flat and without rocks. It has electricity service and potable water, also in summer waste pickup service.\r\n\r\nFrom the land you are near the little town where you can food and anything you need.\r\n\r\nThe place is quiet and has a beautiful view of the hills. Here, you will have a quiet life close to nature.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nPrice: Pesos Hundred and Forty Thousand. ($140.000.-).\r\n\r\n&nbsp;\r\n\r\nBrokerage fee: 5%\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\n&nbsp;\r\n\r\nCorr. Inmb. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<b> </b>', 'T03 Land in Panaholma about 1.200 m2', '', 'publish', 'closed', 'open', '', 't03-land-in-panaholma-about-1-200-m2', '', '', '2014-01-20 19:12:18', '2014-01-20 22:12:18', '', 0, 'http://edificarinmobiliaria.com/en/?p=438', 0, 'post', '', 0),
