(550, 1, '2014-02-06 20:22:35', '2014-02-06 23:22:35', 'It´s situated in a quiet neighbourhood, 450 metres from San Martín Avenue, the commercial center of the city, and three streets from the river.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nEnvironment is characterized by the lodges, rental apartments and houses of very good quality. The land has an area of ​​937 m2. It´s all the services: Drinking Water, Electricity, Waste Collection, Cable TV, Internet, Phone.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nIn this piece of land you can build a house or a project related to the holiday tourists.\r\n\r\nIt is an excellent choice to make a safe investment!!\r\n\r\n&nbsp;\r\n\r\n<span style="text-decoration: underline;">Price</span>: <strong>$ 305.000.- (PESOS THREE HUNDRED and FIVE THOUSAND).</strong>\r\n\r\n&nbsp;\r\n\r\nReal Estate Commission: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nR.E.B. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<b> </b>', 'T09 - Land of 937 m2 in Mina Clavero ', '', 'publish', 'closed', 'open', '', 't09-land-of-937-m2-in-mina-clavero', '', '', '2014-02-06 20:22:35', '2014-02-06 23:22:35', '', 0, 'http://edificarinmobiliaria.com/en/?p=550', 0, 'post', '', 0),
