(560, 1, '2014-02-06 20:37:26', '2014-02-06 23:37:26', 'The land is situated on the road between Panaholma and “Los Morteritos”, about 350 metres from the river, in a place with a sandy; and is 1.900 metres from the square. It has 30 metres front and 40 metres long.\r\n\r\nThe ground is flat and without rocks. It has electricity service and potable water, also in summer waste pickup service.\r\n\r\nFrom the land you are near the little town where you can food and anything you need.\r\n\r\nThe place is quiet and has a beautiful view of the hills. Here, you will have a quiet life close to nature.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nPrice (each land): Pesos Hundred and Forty Thousand. ($140.000.-).\r\n\r\n&nbsp;\r\n\r\nBrokerage fee: 5%\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\n&nbsp;\r\n\r\nCorr. Inmb. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<b> </b>', 'T10-  4 Lands in Panaholma about 1.200 m2', '', 'publish', 'closed', 'open', '', 't10-4-lands-in-panaholma-about-1-200-m2', '', '', '2014-02-06 20:37:26', '2014-02-06 23:37:26', '', 0, 'http://edificarinmobiliaria.com/en/?p=560', 0, 'post', '', 0),
