(591, 1, '2014-03-17 12:03:06', '2014-03-17 15:03:06', '1 Hectare on sale with 128 meters of frontage on Route 15, in front of the access to the area known as "Bajo del Molino".\r\n\r\nIt´s situated 1,9 km to the South from Nono´s downtown, and the river is 1 km. of distance. The water is about 20 meters deep, and you must make a perforation. Electricity is on frontage.\r\n\r\nTitle: deed.\r\n\r\nThe place is ideal for a large variety of commercial projects (hotel, resort cottages, shops, etc.). Important vehicular movement passing through its front all year; with the plus adding, the generating tourist seasons.\r\n\r\nSafe investment in Traslasierras!\r\n\r\n&nbsp;\r\n\r\n<b>Price: PESOS ONE MILLION ONE HUNDRED THOUSAND. ($1.100.000.-).</b>\r\n\r\n&nbsp;\r\n\r\nBrokerage fee: 5%\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\n&nbsp;\r\n\r\nR.E.B. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<b> </b>', 'T12 – 1 Hectare in front of the route, in Nono', '', 'publish', 'closed', 'open', '', 't12-hectare-front-the-route-nono', '', '', '2014-04-28 11:54:30', '2014-04-28 14:54:30', '', 0, 'http://edificarinmobiliaria.com/en/?p=591', 0, 'post', '', 0),
