(636, 1, '2014-05-16 19:07:52', '2014-05-16 22:07:52', 'The little field is situated in a place 740 m. to the North of the town square. From this place you can see the hills and the high picks. The place is very quiet; you ´ll enjoy your life living here!!\r\n\r\n&nbsp;\r\n\r\nThis is a rural area, with native trees. The river is about 800 m. from there.\r\n\r\nIn summer, a lot of families drives to this little town from all Traslasierra Valley, they can swimm in the river and enjoy a sunny day!\r\n\r\n&nbsp;\r\n\r\nThis is an interesting option to build a house to rent or live in a save and quiet place, near Panaholma and about 18 km from Mina Clavero.\r\n\r\n&nbsp;\r\n\r\n<strong>Price:</strong><strong>PESOS FIVE HUNDRED THOUSAND -each Hectare-. ($500.000.- each He).</strong>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nBrokerage fee: 5%\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nR.E.B.  Esteban Urús.\r\n\r\nM.P. Nº4448.\r\n\r\n<strong> </strong>', 'T14 - Plot 2.5 Hectares in Panaholma. ', '', 'publish', 'closed', 'open', '', 't14-plot-hectares-panaholma', '', '', '2014-05-16 19:07:52', '2014-05-16 22:07:52', '', 0, 'http://edificarinmobiliaria.com/en/?p=636', 0, 'post', '', 0),
