(645, 1, '2014-05-16 19:33:49', '2014-05-16 22:33:49', 'This little and flat land, has worked as farm, years ago. Now it´s an interesting opportunity to buy a terrain in Panaholma, near the river.\r\n\r\n&nbsp;\r\n\r\nThe square of the town is situated 900 meters away and the river is about 950 m. from there.\r\n\r\nThe place is quiet and hasa mature forest of native trees.\r\n\r\nThis is an interesting option to build a house to rent or live in a save and quiet place, near Panaholma and about 18 km from Mina Clavero. Here you can develop a project related to summer tourism\r\n\r\n&nbsp;\r\n\r\nWith a beautiful panoramic view of the hills and usually, Panaholma has 320 sunny days per year!!No doubt you can enjoy outdoor living!\r\n\r\n&nbsp;\r\n\r\n<strong>Price: PESOS FIVE HUNDRED AND FIFTY THOUSAND -each Hectare-. ($550.000.- each He).</strong>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nBrokerage fee: 5%\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nR.E.B.  Esteban Urús.\r\n\r\nM.P. Nº4448.\r\n\r\n<strong> </strong>', 'T15 - Land of 3.09 Hectares, in Panaholma. ', '', 'publish', 'closed', 'open', '', 't15-land-hectares-panaholma', '', '', '2014-05-16 19:33:49', '2014-05-16 22:33:49', '', 0, 'http://edificarinmobiliaria.com/en/?p=645', 0, 'post', '', 0),
