(6, 1, '2013-08-01 19:33:14', '2013-08-01 22:33:14', 'Por cualquier consulta no dudes en contactarte con nosotros. Si nos quieres enviar una foto de tu propiedad para poder tasarla o algún otro archivo informativo importante, puedes adjuntarlo a esta consulta. Te responderemos a la brevedad.', 'Contacto', '', 'publish', 'closed', 'closed', '', 'contacto', '', '', '2013-10-21 17:17:01', '2013-10-21 20:17:01', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=6', 0, 'page', '', 0),
