(135, 1, '2013-08-07 14:44:00', '2013-08-07 17:44:00', 'Inmobiliaria Edificar está ubicada en Mina Clavero, iniciando sus actividades en Septiembre de 2.013. Su área de influencia es el valle de Traslasierra.\r\nSe priorizan la calificación, eficiencia y honestidad como ejes centrales del trabajo. La confidencialidad en las consultas y la diligencia profesional nos llevan a cubrir las expectativas de cada cliente, siempre buscando su entera satisfacción. Buscamos soluciones inmobiliarias para cada situación particular. Actuando en forma honesta y profesional, esperamos sobrepasar los desafíos que este trabajo pueda plantear.\r\nConsideramos que nuestra mejor publicidad son los comentarios de un cliente que realizó una operación con nosotros.\r\n<blockquote>Inmobiliaria Edificar es propiedad de R. Esteban Urús, Corredor Inmobiliario M.P. 4448 CPCPI*.\r\nAsesoramiento jurídico: Dr. Guillermo Dutto. Abogado. MP 1-31205.</blockquote>\r\nR. Esteban Urús nació en Saladillo, prov. de Buenos Aires en 1.980. En 2.003 se estableció en Villa Cura Brochero. Desde 2.006 trabajó en inmobiliarias amigas de la zona, con las que se mantienen fuertes lazos afectivos y comerciales. Se formó como Corredor Inmobiliario en el Inst. Cervantes y Universidad Siglo 21. Desde 2.004 forma parte del Centro de Comercio y Turismo de Villa Cura Brochero, ocupando el cargo de Vicepresidente entre los años 2.011 y 2.013. Después de formar su familia en el valle, Traslasierra es por elección, su lugar para vivir; con sus bellos paisajes, agradable clima y tranquilidad.\r\n\r\n<small>*Colegio Profesional de Corredores Públicos Inmobiliarios de la Provincia de Córdoba. Ley 9.445.</small>', 'Quienes Somos', '', 'publish', 'closed', 'closed', '', 'quienes-somos', '', '', '2013-10-05 10:47:44', '2013-10-05 13:47:44', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=135', 0, 'page', '', 0),
