(371, 1, '2013-09-10 19:34:28', '2013-09-10 22:34:28', 'En Villa Cura Brochero podemos visitar la plaza Centenario, con su monumento al Cura Brochero, y al frente d ésta, la iglesia de estilo neogótico donde decansan los resto del cura gaucho.\r\n\r\nUn lugar de visita obligada\r\nEl museo brocheriano, casa de ejercicios espirituales construida por el cura.\r\nLas salas principales albergan numerosos elementos que reconstruyen su vida y obra.\r\nHay un sector que recrea las constumbres de los habitantes de la zona a fines del siglo XIX y otro dedicado a los Comenchingones (habitantes nativos originarios de la zona).\r\nEstá la casa a donde pasó sus últimos días de vida el cura Brochero, enfermo y postrado, exibiendo muebles de la época que él usaba y el patio de la casona que hoy, es un Museo Histórico.\r\nIgualmente hay numerosas Iglesias de la zona que él construyó.', 'Circuito Religioso', '', 'publish', 'closed', 'closed', '', 'circuito-religioso', '', '', '2013-10-09 11:15:26', '2013-10-09 14:15:26', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=371', 0, 'page', '', 0),
(375, 1, '2013-09-10 19:41:05', '2013-09-10 22:41:05', 'A menos de 50 kilómetros de Villa Cura Brochero, por la ruta 15 llegamos a:\r\n\r\n<strong>Taninga</strong>\r\nMirador, volcán Yerba Buena y puerta de acceso a este intersnate circuito.\r\n\r\n<strong>Las Palmas</strong>\r\nCapilla tricentenaria construida entre 1689 y 1736, de líneas simples y rica en imágenes y ornamentos.\r\n\r\n<strong>Quebrada de la Mermela</strong>\r\nPunto cúlmine del recorrido donde se encuentran los túneles y desde donde pueden observarse los Llanos Riojanos y el Valle Chancaní.\r\n\r\n<em>Esta es una de las 7 maravillas de Córdoba construídas por el hombre</em>', 'Circuito de Los Túneles', '', 'publish', 'closed', 'closed', '', 'los-tuneles', '', '', '2013-09-25 12:35:41', '2013-09-25 15:35:41', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=375', 0, 'page', '', 0),
(377, 1, '2013-09-10 19:41:25', '2013-09-10 22:41:25', 'Este pico de 2.889 metros sobre el nivel del mar, es el más alto de las sierras Grandes.\r\nEl ascenso a esta cumbre demanda entre 8 a 10 horas.', 'Cerro Champaquí', '', 'publish', 'closed', 'closed', '', 'cerro-champaqui', '', '', '2013-10-09 09:05:56', '2013-10-09 12:05:56', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=377', 0, 'page', '', 0),
