(397, 1, '2013-09-12 00:33:05', '2013-09-12 03:33:05', 'Este camino fue la primera puerta para comunicar el Valle de Traslasierra con la ciudad de Córdoba.\r\nEs una obra magnífica lograda por el salvador de las almas serranas, el Cura Brochero.\r\nAl recorrerlo entraremos en contacto con una naturaleza prodigiosa.\r\n\r\nLas artesanías de la zona\r\nLa cerámica exclusiva de traslasierra y los tejidos en telar.\r\nA la vera de este camino viven doce familias que exponen en sus propios talleres las artesanías realizadas con técnicas transmitidas de generación en generación.', 'Camino de los Artensanos', '', 'publish', 'closed', 'closed', '', 'camino-de-los-artensanos', '', '', '2013-10-27 10:32:15', '2013-10-27 13:32:15', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=397', 0, 'page', '', 0),
(404, 1, '2013-09-12 01:28:58', '2013-09-12 04:28:58', 'Desde Mina Clavero camino al Dique pasamos por Arroyo de Los Patos y sus hermosas playas doradas, llegando a Nono tenemos en río chico del mismo nombre y paso de las Tropas, camino al museo Rocsen, dos lugares dignos de visitarse.\r\nLos Hornillos capital provincial del ecoturismo y microclima; seguimos por la ruta 14km y llegamos a Los Pozos, desviando a la derecha llegaremos al dique La Viña, que con sus 102 metros de altura es uno de los más altos de América del Sur.\r\nSe puede visitar en el trayecto una fábrica de Queso caprino y otra de aceite de oliva puro. También fábricas de dulces caseros y alfajores entre otros.', 'Circuito Dique la Viña', '', 'publish', 'closed', 'closed', '', 'circuito-dique-la-vina', '', '', '2013-09-24 16:38:20', '2013-09-24 19:38:20', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=404', 0, 'page', '', 0),
(416, 1, '2013-09-12 01:48:01', '2013-09-12 04:48:01', 'Circuito a lo largo de la ruta provincial 34, en donde se puede observar todo el valle desde sus miradores naturales.\r\n\r\n<strong>Río de los Sauces</strong>\r\nParaje con excelentes balnearios, capilla de piedra; se puede practicar caminatas y parapentes.\r\n\r\n<strong>Nacimiento del Rio Mina Clavero</strong>\r\nA 100 metros de la ruta se puede observar una importante cascada.\r\n\r\n<strong>El Cóndor</strong>\r\nPunto más alto de la Pampa de Achala. Parque Nacional Quebrada del Condorito. Se puede acceder caminando o en bicicleta a este lugar, donde se observan cóndores en su hábitat.', 'Ruta de las Alta Cumbres', '', 'publish', 'closed', 'closed', '', 'ruta-de-las-alta-cumbres', '', '', '2013-10-05 10:26:16', '2013-10-05 13:26:16', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=416', 0, 'page', '', 0),
(418, 1, '2013-09-12 01:50:15', '2013-09-12 04:50:15', 'Disfrute Córdoba en traslasierra y sus balneariso en los ríos; Mina Clavero, Panaholma y de los Sauces, el balneario de Los Cedros, Constanera Norte o Balneario Municipal, balneario El Pocito y sobre Los Sauces, los Cajones, los Elefantes y playas doradas, en Mina Clavero, pileta municipal central, Nido del Aguila y La Toma.', 'Balnearios', '', 'publish', 'closed', 'closed', '', 'balnearios', '', '', '2013-09-24 16:37:53', '2013-09-24 19:37:53', '', 0, 'http://localhost/28._InmobiliariaEsteban/?page_id=418', 0, 'page', '', 0),
