(469, 1, '2013-09-21 17:12:22', '2013-09-21 20:12:22', 'Ubicado en cercanías de Ciénaga de Allende, a 22 km. de Mina Clavero. Vertiente, sector de chacra y lomadas suaves con vegetación autóctona.\r\n\r\n&nbsp;\r\n\r\nEl campo se encuentra al Oeste de Mina Clavero, recorriendo 11 km de asfalto por la Ruta Prov. Nº15, se atraviesa Villa Cura Brochero; y luego 11 Km de camino de tierra consolidado. Las 141 has. aprox. están divididas en dos sectores por el camino que une la ruta prov. Nº15 con la ciudad de Villa Dolores. Al norte del mismo una fracción de aprox. 32 has. con un sector de chacra,  pozo balde, cruzando en el Norte un arroyo no permanente. Al Sur se encuentra un lote de 109 has aprox. conformado por con lomadas suaves con abundante vegetación autóctona y pasto. Tiene una pequeña quebrada con una vertiente, cerca de donde se encuentra una cantera de piedra laja, hasta donde llega un camino interior desmejorado. El perímetro está alambrado (excepto un lado del potrero Sur), y en algunos sectores necesita mantenimiento y mejoras. El tendido eléctrico se encuentra a 1.800 metros. Es un campo ideal para ganadería con agua, fácil acceso y la opción de explotar su potencial en extracción piedra laja. Estado de títulos: consultar.   El campo no cuenta con un plano actualizado, deberá realizarse en caso de venta a cargo del comprador; la superficie es aproximada.\r\n\r\n<span style="text-decoration: underline;"> </span>\r\n\r\n<span style="text-decoration: underline;">Precio de Venta</span>:\r\n\r\n<b>141 Has. aprox. x $6.500.- c/una. </b>\r\n\r\nComisión inmobiliaria: 3 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. R. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<b> </b>', 'C01 - 141 Has. aprox. en Ciénaga de Allende', '', 'draft', 'closed', 'closed', '', 'c01-180-has-cienaga-allende', '', '', '2016-07-06 10:38:47', '2016-07-06 13:38:47', '', 0, 'http://www.webmoderna.com.ar/edificarinmobiliaria/?p=469', 0, 'post', '', 0),
