(502, 1, '2013-09-26 11:05:19', '2013-09-26 14:05:19', 'Se vende casa de primera calidad de construcción, con muy buen diseño e iluminación natural. Barrio residencial, tranquilo y cerca del centro.\r\n\r\nCasa ubicada en Villa Cura Brochero, en Bº San José, a seis cuadras del centro comercial de Mina Clavero, a doce cuadras del centro de V. Cura Brochero y a 300 metros del río Panaholma. El barrio se caracteriza por viviendas de buena calidad y complejos de cabañas.\r\n\r\nSe encuentra en un terreno con forma rectangular, con 16 metros de frente y una superficie de 864 m2.\r\n\r\nLa construcción es de primera calidad y cuenta en planta baja con un distribuidor en el ingreso, desde donde se accede a una amplia cocina comedor. Tiene un baño de servicio y una habitación con baño en suite. La planta baja suma 71,16 m2 cubiertos. En planta alta, se accede a una sala de distribución desde donde se puede ingresar a  las 3 habitaciones restantes y a un  tercer baño. Desde el distribuidor también se puede salir a un amplio balcón con una hermosa vista panorámica de las sierras. La planta alta suma 53,50 m2 cubiertos. También cuenta con cochera semicubierta para 2 vehículos con parrilla y un pequeño galpón para depósito de herramientas, etc. La superficie semicubierta es de 35,6 m2.\r\n\r\nLa casa cuenta con servicios de Electricidad, TV Satelital (con opción a TV Cable, Tel. e Internet), Agua Potable de Red, Recolección de Residuos.\r\n\r\nEscritura de Dominio.\r\n\r\nCómoda casa, ideal para vivir en  el valle cómodamente, siendo una inversión segura.\r\n\r\n<b>Precio de Venta: U$S 180.000.- (Dólares Estadounidenses Ciento Ochenta Mil).</b>\r\n\r\nContacto:\r\n\r\nTel. 03544-15431582\r\n\r\nCorr. Inm. Esteban Urús. M.P. 4448.\r\n\r\n&nbsp;\r\n\r\n<b> </b>\r\n\r\n<b> </b>\r\n\r\n<b> </b>', 'V01- Casa de 4 dormitorios en V. Cura Brochero', '', 'draft', 'closed', 'closed', '', 'v01-casa-dormitorios-cura-brochero', '', '', '2018-10-19 10:06:47', '2018-10-19 13:06:47', '', 0, 'h