(717, 1, '2014-02-05 18:53:57', '0000-00-00 00:00:00', 'Situado en agradable y tranquilo barrio, a sólo 450 metros de la Av. San Martín y a 3 cuadras y media del río Los Sauces, en un sector de extensas playas de arena.\n\n&nbsp;\n\nEl entorno se caracteriza por distintos emprendimientos destinados al alquiler temporario, como hosterías y departamentos, y casas de muy buena categoría. Frente al terreno se encuentra el Anfiteatro Municipal de Mina Clavero. Su ubicación es muy buena ya que se encuentra a mitad de camino entre el río Los Sauces (aprox. 400 metros) y el centro comercial de la ciudad (aprox. 450 metros).\n\nEs importante detallar las extensas playas de arena que tiene el río Los Sauces en ese sector lo que permite disfrutar todo el año con su hermosa vista de las altas cumbres.\n\nEl inmueble es rectangular y suma una superficie de 934 m2. Es llano y sin superficies rocosas, 100% tierra, lo que facilita la construcción. Tiene una importante cantidad de árboles, que brindan una fresca sombra en verano.\n\nEl terreno accede a todos los servicios locales (Agua Potable de Red, Energía Eléctrica, Te., TV cable, Internet, Recolección de Residuos).\n\n&nbsp;\n\nEstado de Títulos: Escritura de Dominio.\n\n&nbsp;\n\nSi busca un lugar tranquilo y cerca del centro para construir una casa y/o un proyecto relacionado con la actividad turística, se encuentra ante una excelente opción!!\n\n&nbsp;\n\n<span style="text-decoration: underline;">Precio de Venta</span>: <strong>$ 305.000.- (PESOS TRESCIENTOS CINCO MIL).</strong>\n\n&nbsp;\n\nComisión inmobiliaria: 5 %\n\n&nbsp;\n\nTel.03544-15431582\n\nC.P.I. Esteban Urús.\n\nMat. Nº4448.\n\n<b> </b>', 'T09- Lote de 934 m2. Excelente ubicación en Mina Clavero. ', '', 'draft', 'closed', 'open', '', '', '', '', '2014-02-05 18:53:57', '2014-02-05 21:53:57', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=717', 0, 'post', '', 0),
