(733, 1, '2014-02-06 12:18:09', '2014-02-06 15:18:09', 'Se venden 4 terrenos de 1.200 m2 cada uno en Panaholma, ubicado a 350 metros del río Panaholma, sobre camino consolidado. Zona muy tranquila con hermosa vista panorámica.\r\n\r\n&nbsp;\r\n\r\nCon frente sobre el camino que une Panaholma con “Los Morteritos”, a sólo 1.600 metros del vado de Panaholma. Cada lote es rectangular, con 30 metros de frente (e igual contrafrente), por 40 metros de fondo, sumando 1.200 m2 de superficie.\r\n\r\nLos lotes son totalmente llanos y sin superficies rocosas, ideal para la forestación y la construcción.\r\n\r\nEl servicio de Electricidad pasa por el frente, al igual que el servicio de Agua Potable de Red suministrado por la comuna. Durante la temporada turística cuenta con recolección de residuos.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias. Cumple perfectamente con requisitos para iniciar Usucapión.\r\n\r\nEs una muy buena opción para construir una vivienda o unidades de alquiler dado su cercanía al río en un sector de playas con abundante arena. Panaholma ofrece paisajes y tranquilidad. Estos lotes son una muy buena opción como inversión a modo de reserva de valor dada su buena ubicación.\r\n\r\n<b> </b>\r\n\r\n<b> </b>\r\n\r\n<b>Precio de cada uno de las Fracciones: PESOS DOSCIENTOSMIL ($200.000.-)</b>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM. P. Nº4448.\r\n\r\n<b> </b>', 'T10- 4 Fracciones en bloque o separados.', '', 'draft', 'closed', 'closed', '', 't10-4terrenos-bloque-separados', '', '', '2018-11-02 18:32:50', '2018-11-02 21:32:50', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=733', 0, 'post', '', 0),
