(793, 1, '2014-03-12 12:04:34', '2014-03-12 15:04:34', 'Se vende terreno de 1 Ha., con 128 metros de frente sobre la Ruta Prov. Nº 14, frente al acceso a la zona conocida como “Bajo del Molino”, en Nono. A 1 km. del río Chico. Ideal para proyecto comercial, debido al tránsito que allí circula todo el año.\r\n\r\nPara acceder al lote, partiendo desde el centro de Nono, se recorren por la Ruta Prov. Nº14 1,9 km. hacia el Sur. Frente al mismo se encuentra un refugio para esperar colectivos y nace el camino para “Bajo del Molino”, una zona de casas quintas y complejos de cabañas.\r\n\r\nEl terreno es rectangular, con 128 metros de frente, igual contrafrente, 74 metros de fondo en el lado Norte y 78.5 metros de fondo en el límite Sur. Suma 1 Ha. de superficie. Es llano con tierra, sin superficies rocosas y tiene árboles autóctonos de distintos tamaños. Se encuentra amojonado y tiene alambrado (por mejorar) el frente. No están alambrados el fondo ni los laterales.\r\n\r\nEl agua se encuentra a 20 metros de profundidad aproximadamente. El cableado de Electricidad pasa por el frente.\r\n\r\nEstado de Títulos: Escritura de Dominio.\r\n\r\nEste lote es una opción única como reserva de valor ya que está proyectado realizar un nuevo acceso a Nono por el lado Sur, en cercanías a este inmueble. Ideal para una importante variedad de proyectos comerciales (hotel, complejo de cabañas, locales comerciales, etc.), debido al importante movimiento vehicular que pasa por su frente todo el año, sumando el plus que generan las temporadas turísticas. Inversión segura en Traslasierra!!!\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<b>Precio: PESOS CIENTO NOVENTA POR METRO CUADRADO. ($190.- x c/m2)</b>\r\n\r\n<b> </b>\r\n\r\nComisión inmobiliaria: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM. P. 4448.\r\n\r\n<b> </b>', 'T12- 1 Hectárea frente a la Ruta en Nono', '', 'draft', 'closed', 'closed', '', 't12-hectarea-frente-ruta-nono', '', '', '2018-02-06 12:07:04', '2018-02-06 15:07:04', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=793', 0, 'post', '', 0),
