(852, 1, '2014-05-10 11:42:15', '2014-05-10 14:42:15', 'Este terreno está ubicado a 740 metros de la plaza principal de Panaholma, con una bella vista del paisaje serrano, es una excelente opción para un desarrollo turístico.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nPanaholma es un pequeño pueblo serrano, ubicado a 18 km. al Norte de Villa Cura Brochero y Mina Clavero. Se accede por asfalto hasta su plaza principal. Por el pueblo tiene su cauce el Río homónimo. En los últimos años este poblado ha tenido un importante crecimiento con cabañas y servicios turísticos, trabajando todos exitosamente.\r\n\r\nEl lote se encuentra hacia el Norte del centro de Panaholma que está comenzando su desarrollo de muy buena manera manteniendo la tranquilidad que caracteriza a este pueblo serrano, conjuntamente con su bello paisaje y excelente clima.\r\n\r\nEl terreno tiene una forma rectangular (irregular), con 250 metros de frente sobre camino público. Se encuentra a 740 metros de la plaza principal y a 800 metros del río Panaholma.\r\n\r\nEl predio tiene un leve desnivel ascendente que le brinda una bella vista, y tiene una importante cantidad de árboles autóctonos.\r\n\r\nEl servicio de Electricidad pasa por el frente y el agua se puede extraer mediante un pozo o perforación.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias. Cumple perfectamente con requisitos para iniciar Usucapión.\r\n\r\nEs una interesante opción para la construcción de un Complejo de cabañas o para subdividir y vender lotes más pequeños. Ideal para realizar un emprendimiento en un lugar tranquilo con una óptima proyección de crecimiento!!\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<strong>Precio: $500.000.- por Ha. (PESOS QUINIENTOS MIL por Ha.).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<strong> </strong>', 'T14- Parcela de 2,5 Has. Panaholma. ', '', 'publish', 'closed', 'open', '', 't14-parcela-has-panaholma', '', '', '2014-05-16 19:12:36', '2014-05-16 22:12:36', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=852', 0, 'post', '', 0),
