(861, 1, '2014-05-12 19:38:06', '2014-05-12 22:38:06', 'Bella parcela que ha sido trabajada como chacra, con un monte autóctono. Es ideal para un emprendimiento en la tranquila localidad de Panaholma.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nEste terreno está ubicado a 920 metros de la plaza principal del pueblo, con una vista panorámica de las sierras, es una excelente opción para un desarrollo turístico.\r\n\r\nPanaholma es un pequeño pueblo serrano, ubicado a 18 km. al Norte de Villa Cura Brochero y Mina Clavero. El lote se encuentra hacia el Norte de la plaza principal.\r\n\r\nEl terreno tiene una forma cuadrada (irregular), con 193 metros de frente sobre camino público. Se encuentra a 920 metros de la plaza principal y a 950 metros del río Panaholma.\r\n\r\nEl terreno es llano y 100% tierra; en el pasado ha sido utilizado como chacra para la siembra. En el sector central hay un pequeño monte de árboles autóctonos que brindan una fresca sombra en verano.\r\n\r\nEl servicio de Electricidad pasa por el frente y el agua se puede extraer mediante un pozo o perforación.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias. Cumple perfectamente con requisitos para iniciar Usucapión.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nEsta parcela permite varias opciones de desarrollo, desde un proyecto relacionado con el turismo, hasta la posibilidad de subdividir para realizar la venta de lotes más pequeños. Interesante opción en una zona que no frena su crecimiento!!\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<strong>Precio: $550.000.- por Ha. (PESOS QUINIENTOS CINCUENTA MIL por Ha.).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<strong> </strong>', 'T15- Espectacular fracción 3,09 Has. ', '', 'publish', 'closed', 'open', '', 't15-espectacular-fraccion-309-has', '', '', '2014-05-12 19:38:06', '2014-05-12 22:38:06', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=861', 0, 'post', '', 0),
