(872, 1, '2014-05-15 11:18:45', '2014-05-15 14:18:45', 'Casa ubicada en tranquilo barrio de Cura Brochero, cerca del río Panaholma, ideal para vivienda permanente.\r\n\r\n&nbsp;\r\n\r\nLa casa está ubicada en el tranquilo barrio “Jardín”, de Villa Cura Brochero, sobre la calle G. Bustos, a 8 cuadras del centro del pueblo y a 4 del río Panaholma, con sus bellos balnearios.\r\n\r\nEl terreno es rectangular, con 394 m2 de superficie.\r\n\r\nLa construcción se divide en dos sectores; el más amplio, tiene en Planta Baja cocina comedor, un dormitorio y un baño, que suman 52 m2 de superficie, subiendo por una escalera de madera, se accede a un entrepiso de 16 m2 que se utiliza como un segundo dormitorio. Separado de esta construcción con una cochera techada  de 20 m2, hay otra habitación, a modo de mono ambiente con baño en suite, que suma 16 m2 aproximadamente.\r\n\r\nLa casa se vende con cocina, helara, cama cucheta, 2 televisores, termo tanque, lavarropas automático, una salamandra, camas de 1 plaza, cama de dos plazas, mesa y sillas.\r\n\r\nEl inmueble está en un muy buen estado de conservación.\r\n\r\nLa casa cuenta con servicios de Electricidad, Agua Potable de Red, Recolección de Residuos, (con opción a TV Cable, Teléfono e Internet). Para la petición de servicios, se realizó un bosquejo pero no tiene planos aprobados.\r\n\r\nEstado de Títulos: Escritura de Dominio.\r\n\r\nUbicada en una zona tranquila, ideal para descansar; pudiendo generar una renta durante la temporada turística.\r\n\r\n<strong>Precio de Venta: Consultar. </strong>\r\n\r\n<strong>Comisión Inmobiliaria: 3%.</strong>\r\n\r\nContacto:\r\n\r\nTel. 03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448.\r\n\r\n&nbsp;', 'V07- Casa en Cura Brochero.', '', 'draft', 'closed', 'closed', '', 'v07-casa-cura-brochero', '', '', '2017-04-21 10:49:51', '2017-04-21 13:49:51', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=872', 0, 'post', '', 0),
