(963, 1, '2014-08-19 17:41:27', '2014-08-19 20:41:27', 'Este Complejo está ubicado en “Cruz de Caña”, a 20 km. hacia el Este de la ruta Nº38, camino a la estancia Jesuítica “La Candelaria”, rodeada de un bello paisaje y tiene en una zona en la que se vive con total tranquilidad.\r\n\r\nEl complejo fue construido en un terreno de 3.560 m2 de superficie. Consta de una casa principal, de 140 m2, que tiene Living-Comedor, 2 baños, 4 dormitorios, lavadero y depósito. También cuenta con dos cabañas de 50 m2 cada una, equipadas para alquilar. Finalmente una cabaña de 35 m2, también equipada. Existe la posibilidad de aumentar la cantidad de unidades.\r\n\r\nEstado de títulos: Derechos y Acciones Posesorias.\r\n\r\nEl atractivo turístico de la Estancia Jesuítica y  el entorno serrano, generan una interesante proyección turística en la zona. Coordine una visita personalmente y conozca mayores detalles.\r\n\r\n&nbsp;\r\n\r\nPrecio: PESOS UN MILLÓN SEISCIENTOS MIL ($1.600.000.-).\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\n&nbsp;\r\n\r\nContacto: C.P.I. Esteban Urús. M.P. 4448.\r\n\r\nTel.:03544-15431582.\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'N04-Se vende Casa con 3 Cabañas. Tranquilidad!!', '', 'private', 'closed', 'closed', '', 'vende-casa-con-cabanas-tranquilidad', '', '', '2016-10-18 18:40:17', '2016-10-18 21:40:17', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=963', 0, 'post', '', 0),
