(994, 1, '2014-09-25 19:06:22', '2014-09-25 22:06:22', 'Se vende casa ubicada en tranquilo barrio de Mina Clavero, a 330 metros de la Av. Mitre. Cuenta con 3 dormitorios. Muy buena calidad constructiva, faltan detalles de terminación.\r\n\r\n&nbsp;\r\n\r\nEste inmueble está ubicado en la calle Las Artes, en un barrio tranquilo y familiar, a 800 metros aprox. del río Los Sauces.\r\n\r\nLa vivienda fue construida sobre un terreno de 800 m2, con forma rectangular con un frente de 18 metros por 50 metros de fondo. La construcción de aproximadamente 6 años de antigüedad, fue realizada con excelentes materiales de construcción. La casa tiene 127 m2 cubiertos y 40 m2 semi cubiertos.\r\n\r\nSe ingresa a un amplio estar comedor, unido a la cocina, desde allí un pasillo de distribución, lleva a los 3 dormitorios, los dos baños (uno sin terminar) y el lavadero. Tanto los pasillos como las habitaciones son amplios y luminosos, con muy buenas aberturas. La casa tiene un diseño moderno que la hace muy atractiva.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEl estado general de la casa es muy bueno, con algunos detalles de terminación. Es una casa muy interesante considerando los metros cubiertos y la intimidad de la misma.\r\n\r\n&nbsp;\r\n\r\nPrecio: PESOS DOS MILLONES CUATROCIENTOSMIL ($2.400.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n&nbsp;\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448\r\n\r\n03544-15431582', 'V10-Casa de 3 dormitorios. Mina Clavero.', '', 'draft', 'closed', 'closed', '', 'v10-casa-dormitorios-mina-clavero', '', '', '2017-04-21 10:51:29', '2017-04-21 13:51:29', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=994', 0, 'post', '', 0),
