(1015, 1, '2014-10-01 18:41:00', '2014-10-01 21:41:00', 'Este importante terreno tiene frente sobre la Av. Intendente Vila y sobre la calle Colón, apto para proyecto turístico. Imponente vista de las Altas Cumbres a pocas cuadras del centro.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nEl entorno se caracteriza por casas de distinta antigüedad en un sector que se encuentra actualmente en crecimiento. Se encuentra a 700 metros de la Av. San Martín, peatonal en el verano; y a 500 metros del río Mina Clavero. El terreno suma 37 metros de frente sobre la Av. Intendente Vila y 20 metros de frente sobre la calle Colón. Tiene forma irregular y suma 4.500 m2 de superficie, con leves desniveles y con forestación autóctona, lo que genera un clima de contacto con la naturaleza.\r\n\r\nFactibilidad de servicios de Electricidad, Agua Potable de Red, TV Cable, Internet, Recolección de Residuos.\r\n\r\nHacia el Este se pueden observar unas sierras bajas forestadas y detrás de ellas las Altas Cumbres, lo que genera una imponente postal del valle.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias. En condiciones para iniciar Usucapión.\r\n\r\n&nbsp;\r\n\r\nEste inmueble es ideal para desarrollar un complejo de alojamiento turístico, cerca del centro comercial, pero con una impronta serrana, y de contacto con la naturaleza. No dude en visitarnos y coordinar una visita!!\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nPrecio de Venta: <strong>$ 1.100.000.- (PESOS UN MILLÓN CIEN MIL).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<strong> </strong>', 'T19- Importante lote de 4.500 m2 en Mina Clavero.', '', 'private', 'closed', 'closed', '', 't19-importante-lote-500-mina-clavero', '', '', '2017-04-10 11:17:23', '2017-04-10 14:17:23', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1015', 0, 'post', '', 0),
