(1026, 1, '2014-10-02 17:44:24', '2014-10-02 20:44:24', 'Este Complejo está ubicado en Villa Cura Brochero, a escasos metros del río Panaholma y de Mina Clavero. Cuenta con piscina y está totalmente equipado. Alquiler asegurado!!\r\n\r\n&nbsp;\r\n\r\nSe encuentra en un barrio residencial, caracterizado por viviendas de buena categoría y por cabañas de alquiler temporario. Se encuentra a 200 metros del río Panaholma y a 450 metros de la Av. San Martín, en el centro comercial de Mina Clavero. La plaza Centenario, en el centro de Villa Cura Brochero, se encuentra a 15 cuadras. El barrio tiene gran afluencia de turistas durante la temporada debido a que es reconocido por contar con distintas opciones de alquiler temporario.\r\n\r\nEl complejo fue construido en 4 terrenos que suman 1.700 m2 de superficie, por lo que le queda un importante sector verde, que permite la construcción de más unidades en el futuro. El complejo cuenta con 5 cabañas: una con capacidad para 7 personas, 3 cabañas con capacidad para 4 personas y una cabaña con capacidad para 2 personas. Hay una amplia galería con parrilla, que se utiliza a modo de quincho. Cuenta con una piscina para adultos y otra pequeña para niños. Las construcciones tienen una antigüedad aproximada de 15 años, pero se encuentran en un excelente estado de conservación, debido al constante mantenimiento por parte de los propietarios.\r\n\r\nCuentan con servicios de Electricidad, Agua Potable de Red, Recolección de Residuos, posibilidad de Internet, TV Cable.\r\n\r\nSI Usted desea realizar un cambio de vida, eligiendo un lugar seguro y tranquilo, con un bello paisaje y un clima benigno; este Complejo de cabañas en Villa Cura Brochero puede brindar un importante ingreso anual. Tiene posibilidades de ampliación y una importante proyección comercial. No dude en consultarnos!!\r\n\r\nPrecio: CONSULTAR.\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\n&nbsp;\r\n\r\nContacto: C.P.I. Esteban Urús. M.P. 4448.\r\n\r\nTel.:03544-15431582.\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'N05- Complejo con 5 Cabañas. Excelente opción!!', '', 'private', 'closed', 'closed', '', 'n05-complejo-con-cabanas-excelente-opcion', '', '', '2016-10-18 18:35:32', '2016-10-18 21:35:32', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1026', 0, 'post', '', 0),
