(1038, 1, '2014-10-08 18:46:10', '2014-10-08 21:46:10', 'Se vende este interesante inmueble, ubicado sobre amplio lote, con dos viviendas, apto para desarrollos turísticos de distinta índole. Importante arboleda. Cercanía al centro de V. Cura Brochero y a escasos metros del río Panaholma, en unos de los sectores más visitados del río.\r\n\r\nEste inmueble está ubicado sobre la calle H. Yrigoyen, a 500 metros de la plaza principal del pueblo, con su centro histórico, y a 90 metros del río Panaholma, en un sector elegido por los turistas ya que tiene extensas playas de arena, en un marco familiar.\r\n\r\nEl terreno tiene 20 metros de frente aprox. sobre H. Yrigoyen, con una forma rectangular irregular y 2.757 m2 de superficie.\r\n\r\nCuenta con dos viviendas, la primera cuenta con cocina-comedor con hogar a leña, baño, y dos dormitorios. Dos de sus paredes tienen cámara intermedia para aislar de mejor forma. Todos los ambientes tienen conexión de gas para calefactores. Cuenta con cochera con parrilla y lavadero externo. Suma 56 m2 cubiertos aprox. y 22,8 m2 semi cubiertos aprox. Esta casa tiene una antigüedad de 8 años y se encuentra en muy buen estado de conservación.\r\n\r\nLa segunda casa tiene un sector más antiguo al que se le realizó una ampliación hace 4 años. Tiene una pequeña cocina, un baño y un living comedor. Suma 38 m2 cubiertos.\r\n\r\nTambién cuenta con un galpón, de 30 m2 cubiertos aprox., al que se le pueden realizar algunas mejoras. En forma separada hay 2 baños exteriores contiguos, que construyó el anterior propietario, con la finalidad de desarrollar un camping.\r\n\r\nEste es un inmueble que tiene distintas opciones de desarrollo, su cercanía al centro y al río, lo ubican en un lugar privilegiado de V. Cura Brochero. Considerando la amplia superficie del terreno, permite la construcción de cabañas, de una hostería, u otros proyectos comerciales. No deje de consultar por este inmueble!!\r\n\r\n&nbsp;\r\n\r\nPrecio:U$S 130.000.- .\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V12- Dos casas en 2.757 m2 de terreno. A 90 metros del río!', '', 'publish', 'closed', 'closed', '', 'v12-dos-casas-757-terreno-metros-del-rio', '', '', '2018-12-21 19:41:58', '2018-12-21 22:41:58', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1038', 0, 'post', '', 0),
