(1050, 1, '2014-10-22 19:05:10', '2014-10-22 22:05:10', 'Ubicado a 22,5 km. de Mina Clavero. Perímetro alambrado con 7 lotes internos. Molino funcionando. Electricidad en el frente. 100% chacra.\r\n\r\n&nbsp;\r\n\r\nEl campo se encuentra al Nor-Oeste de Mina Clavero, recorriendo 20 km de asfalto por la Ruta Prov. Nº15, se atraviesa Villa Cura Brochero; y luego 2,5 Km de camino de tierra consolidado. Las 10 has. aprox. están divididas en 7 lotes, para un mejor uso de la tierra. Es un campo llano, 100% tierra. El perímetro está alambrado. Obtiene agua mediante molino, desde 60 metros de profundidad. El tendido eléctrico pasa por el frente de la propiedad. Cuenta con un monte frutal con ciruelos, higueras, nogales, manzanos, durazneros, etc.\r\n\r\nLa casa tiene 90 m2 cubiertos  aprox., y cuenta con Cocina, Comedor, 3 Dormitorios y un baño.  Techo de losa. Necesita algunos detalles de terminación.\r\n\r\nEstado de títulos: Derechos y Acciones Posesorias, superando los 20 años de posesión. Apto para iniciar Usucapión.\r\n\r\nEs un campo en el que se puede realizar una producción agrícola, ganadera o mixta, ya que su geografía llana y la calidad de la tierra así lo permiten. Ideal para un cambio de vida a escasos minutos de Mina Clavero y Villa Cura Brochero.\r\n\r\nNo deje de visitar este interesante inmueble!!!\r\n\r\n&nbsp;\r\n\r\nPrecio de Venta:\r\n\r\n<strong>PESOS OCHOCIENTOS MIL ($800.000.-) </strong>\r\n\r\nComisión inmobiliaria: 3 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. R. Esteban Urús.\r\n\r\nMat. Nº4448.\r\n\r\n<strong> </strong>\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'C05 - 10 Has. aprox. en Pampa de Pocho', '', 'draft', 'closed', 'closed', '', 'c05-has-aprox-pampa-pocho', '', '', '2018-11-12 11:46:23', '2018-11-12 14:46:23', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1050', 0, 'post', '', 0),
