(1085, 1, '2014-12-11 12:35:08', '2014-12-11 15:35:08', 'Ubicada a 6 km. de la plaza principal de V. Cura Brochero, esta parcela ofrece la tranquilidad y el entorno de las sierras, a escasos minutos de los servicios del pueblo.\r\n\r\n&nbsp;\r\n\r\nSe encuentra en un entorno rural, rodeada de parcelas de similar tamaño, con vegetación autóctona. Tiene un forma rectangular, con 317 metros aprox. en su lado Norte, 354 metros aprox. en su lado Sur y 100 metros de largo aprox. en sus límites Este y Oeste. Sumando una superficie de 3 Has. 3.480 m2 de superficie aprox. Su superficie es llana con algún desnivel, con muchas de las especies de árboles nativos. Falta terminar de alambrar una parte del perímetro. En un sector de su interior pasa una línea de Alta Tensión de Electricidad, que se dirige a V. Cura Brochero. El vendedor está realizando en este momento la obra de tendido eléctrico que pasará por el frente de este terreno y desde donde podrá conectarse, para recibir este servicio.\r\n\r\nEstado de Títulos: Escritura de Dominio.\r\n\r\nEs un lote que permite realizar distintos proyectos turísticos, así como la construcción de una vivienda familiar, en un entorno serrano a sólo 6 km. de la plaza principal de Villa Cura Brochero.\r\n\r\n&nbsp;\r\n\r\nPrecio por Hectárea: <strong>Dólares Estadounidenses Veintidós Mil (U$S 22.000.-). Puede                                                  .                                 abonarse en Pesos, a valor oficial. </strong>\r\n\r\n&nbsp;\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nContacto: 03544-15431582.\r\n\r\nC.P.I. Esteban Urús.  M.P. 4448\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'C06- 3,34 Has. Parcela en las sierras en Mina Clavero.', '', 'publish', 'closed', 'open', '', 'c06-334-has-parcela-las-sierras-mina-clavero', '', '', '2014-12-11 12:36:11', '2014-12-11 15:36:11', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1085', 0, 'post', '', 0),
