(1098, 1, '2014-12-20 12:03:03', '2014-12-20 15:03:03', 'Chacra de 13 Has. ubicada a 5 km. de V. Cura Brochero y a 7 Km. de Mina Clavero, ofrece un amplio entorno rural. Posibilidad de desarrollos.\r\n\r\n&nbsp;\r\n\r\nSe encuentra en un entorno serrano, con gran variedad de ejemplares de vegetación autóctona. Tiene un forma rectangular, con 521 metros aprox. en su lado Norte, 526 metros aprox. en su lado Sur y 229 metros aprox. en el Oeste y 260 metros aprox. en Este. Sumando una superficie de 13 Has. de superficie aprox. Su superficie es mayormente llana con algún desnivel, tiene una barranca que atraviesa el sector sur, con una vertiente de agua permanente todo el año. Falta terminar de alambrar una parte del perímetro. El vendedor está realizando en este momento la obra de tendido eléctrico que pasará por el frente de este terreno y desde donde podrá conectarse, para recibir este servicio.\r\n\r\nEstado de Títulos: Escritura de Dominio.\r\n\r\nEs un lote que permite realizar distintos proyectos turísticos, desde hospedaje hasta paseos o parque temático. Realice una visita personalmente a esta bella chacra!\r\n\r\n&nbsp;\r\n\r\nPrecio por Hectárea: <strong>Dólares Estadounidenses Treinta Mil (U$S 30.000.-). Puede                                                  .                                    abonarse en Pesos, a valor oficial. </strong>\r\n\r\n&nbsp;\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nContacto: 03544-15431582.\r\n\r\nC.P.I. Esteban Urús.  M.P. 4448\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'C07-  13 Has. en las sierras. Opción única!!', '', 'publish', 'closed', 'open', '', 'c07-has-las-sierras-opcion-unica', '', '', '2014-12-20 12:03:03', '2014-12-20 15:03:03', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1098', 0, 'post', '', 0),
