(1111, 1, '2014-12-27 12:45:19', '2014-12-27 15:45:19', '&nbsp;\r\n\r\nIncreíble parcela con 160 metros aprox. de frente sobre el río Los Sauces, en un sector con amplias playas de arena, frente a Mina Clavero. Suma 5,27 Has. ubicada a 5 km. de V. Cura Brochero y a 7 Km. de Mina Clavero, ofrece un amplio entorno rural con vertiente de agua todo el año. Posibilidad de desarrollos.\r\n\r\n&nbsp;\r\n\r\nSe encuentra en un entorno serrano, con gran variedad de ejemplares de vegetación autóctona. Tiene una forma rectangular, con el lado del frente del río irregular. Es una parcela absolutamente única, ya que no hay otras opciones en venta con estas características. Cuenta con una vertiente de agua permanente todo el año. Falta terminar de alambrar una parte del perímetro. El vendedor está realizando en este momento la obra de tendido eléctrico que pasará por el frente de este terreno y desde donde podrá conectarse, para recibir este servicio.\r\n\r\nEstado de Títulos: Escritura de Dominio.\r\n\r\nEste terreno cuenta con la característica más buscada por los turistas: bajada propia al río, sumado a su importante extensión. Es un lote que permite realizar distintos proyectos turísticos, sólo limitado por las características que el comprador elija para plasmar en su proyecto. Coordine visita a esta parcela y enamórese!\r\n\r\n&nbsp;\r\n\r\nPrecio por Hectárea: <strong>Dólares Estadounidenses Ochenta Mil (U$S 80.000.-). Puede                                                  .                                    abonarse en Pesos, a valor oficial. </strong>\r\n\r\n&nbsp;\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nContacto: 03544-15431582.\r\n\r\nC.P.I. Esteban Urús.  M.P. 4448\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'C08-  5 Has. Frente al río Los Sauces!!! Imperdible!!', '', 'publish', 'closed', 'open', '', 'c08-has-frente-rio-los-sauces-imperdible', '', '', '2014-12-27 12:45:19', '2014-12-27 15:45:19', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1111', 0, 'post', '', 0),
