(1122, 1, '2015-01-17 12:19:32', '2015-01-17 15:19:32', 'Se vende casa ubicada en tranquilo barrio residencial de Cura Brochero, a pocos metros del río Panaholma y cerca del centro comercial. Excelente estado de conservación. Interesante opción!!\r\n\r\n&nbsp;\r\n\r\nEste inmueble está ubicado en Villa Cura Brochero, a 100 metros del río Panaholma. Se encuentra a once cuadras de la plaza principal de Cura Brochero.\r\n\r\nLa vivienda fue construida sobre un terreno rectangular con 13 metros de frente por 37 metros aprox. de fondo, sumando una superficie según plano de 486,2 m2. Todo su perímetro está cerrado. La construcción data de 2.005 aprox., con un enorme esmero en su mantenimiento. Tiene la siguiente distribución: se ingresa a una amplia cocina comedor con hogar, desde la que se puede acceder a los dos dormitorios y al baño.  La casa suma unos 69 m2 cubiertos y 17 m2 semicubiertos. Está diseñada con funcionalidad y luminosidad. En el fondo del terreno, que se encuentra totalmente parquizado, se encuentra un salón de usos múltiples con un baño.\r\n\r\nSi desea adquirir una casa  para disfrutar con su familia en un barrio tranquilo y cerca del río Panaholma, visite este inmueble.\r\n\r\n&nbsp;\r\n\r\nPrecio: DÓLARES ESTADOUNIDENSES OCHENTAMIL (U$S 80.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448\r\n\r\n&nbsp;', 'V13- Casa de 2 dormitorios. Buena Ubicación', '', 'draft', 'closed', 'closed', '', 'v13-casa-dormitorios-buena-ubicacion', '', '', '2017-04-22 11:34:04', '2017-04-22 14:34:04', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1122', 0, 'post', '', 0),
