(1158, 1, '2015-02-06 10:54:59', '2015-02-06 13:54:59', '&nbsp;\r\n\r\nUbicado en San Lorenzo, a 1.300 metros de la rotonda que lo une con V. Cura Brochero ya 3 km del centro de Mina Clavero, con acceso sobre el asfalto, se encuentra “El Alto de San Lorenzo”. Vista panorámica. Excelente opción de inversión.\r\n\r\nLa amplitud de las parcelas, los paisajes panorámicos, la cercanía a las ciudades y los balnearios, conjuntamente con  poder disfrutar de la naturaleza, son conceptos básicos considerados en “El Alto”. Cuenta con una amplia avenida de acceso de más de 21 metros de ancho, tres plazas de 5.000 m2 cada una,  estratégicamente ubicadas. Este proyecto considera poder disfrutar de una vida o vacaciones en familia, sin perder los formidables paisajes, demorando menos de 5 minutos hasta Cura Brochero o Mina Clavero, por asfalto.\r\n\r\nServicio de Electricidad listo para la conexión y trabajando en la obra de Agua de Red.\r\n\r\nEstado de títulos: Derechos y Acciones Posesorias en condiciones para iniciar Usucapión.\r\n\r\nEl lugar es ideal para planificar tanto una vivienda familiar como un complejo de cabañas, ya que el entorno asegura tranquilidad. Visite personalmente esta opción y enamórese de Traslasierra!!\r\n\r\n&nbsp;\r\n\r\nPrecio de Venta:\r\n\r\n<strong>Desde $275.- por m2.- (PESOS DOSCIENTOS SETENTA Y CINCO POR METRO CUADRADO). </strong>\r\n\r\n<strong>    Promoción: Desde $258.- por m2.- (Pago Contado Efectivo).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 5 %\r\n\r\nContacto:\r\n\r\nTel.03544-15431582\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús. M.P. Nº4448.', 'T 22 - PARCELAS DESDE 1.000 M2 EN “EL ALTO DE SAN LORENZO”', '', 'publish', 'closed', 'closed', '', 'lotes-desde-000-alto-san-lorenzo', '', '', '2018-10-22 19:23:56', '2018-10-22 22:23:56', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1158', 0, 'post', '', 0),
