(1208, 1, '2015-06-11 19:22:06', '2015-06-11 22:22:06', 'Se venden dos cabañas en San Lorenzo. Ubicada en un terreno de 1.028 m2 de superficie. Interesante opción de inversión con posibilidad de renta. Ubicada a 450 metros aprox. del Río Panaholma.\r\n\r\nEl inmueble se encuentra en el barrio ubicado en cercanías al balneario “Las Maravillas”, sector perteneciente a la Comuna de San Lorenzo. La zona ha tenido un importante crecimiento en los últimos años. El terreno tiene 20 metros de frente y una superficie de 1.028 m2 aproximadamente.\r\n\r\nTiene construidas dos cabañas. Una con galería, cocina comedor, un baño y un dormitorio en P.B., y en Planta Alta, otro dormitorio y un balcón. Tiene 58 m2 cubiertos aprox. y 16 m2 semi cubiertos aprox. La segunda unidad es más pequeña, tiene 25 m2 cubiertos, con cocina comedor, baño y un dormitorio; también cuenta con una galería.\r\n\r\nCuenta con Electricidad, se está gestionando una ampliación de red.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias.\r\n\r\nEL barrio es tranquilo, con cercanía al río y contacto con la naturaleza. Una interesante opción para quien busca un cambio de vida!!\r\n\r\n<strong>Precio de Venta: $ 700.000.- (PESOS SETECIENTOS MIL). </strong>\r\n\r\nContacto:\r\n\r\nTel. 03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448.', 'V17- Dos cabañas en San Lorenzo.', '', 'draft', 'closed', 'open', '', 'v17-dos-cabanas-san-lorenzo', '', '', '2016-06-27 10:16:49', '2016-06-27 13:16:49', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1208', 0, 'post', '', 0),
