(1217, 1, '2015-06-13 12:53:15', '2015-06-13 15:53:15', 'Se vende amplia casa de 200 m2 aproximadamente más cómodo departamento. Ubicada en un terreno de 8.317 m2 de superficie. Opción de renta y de aumento de unidades!\r\n\r\nEl inmueble se encuentra en cercanías al barrio “La Antigua”, a 1.100 metros del río Panaholma, en V. Cura Brochero. La zona se caracteriza por construcciones de viviendas en los últimos años.\r\n\r\nEl terreno tiene una superficie de 8.317 m2 aproximadamente. Es llano y con tierra, a lo que se suma una amplia vista de las Altas Cumbres.\r\n\r\nLa casa tiene la siguiente distribución: Amplia cocina comedor con excelente iluminación natural y ventanales hacia las sierras, desde allí se ingresa a un pasillo por el que se accede primero a un dormitorio con baño en suite. Luego a un segundo dormitorio y finalmente a un baño de uso general. Los materiales utilizados son de muy buena calidad. Cuenta con una cómoda galería en forma de “L” que finaliza en un asador. Cuenta con 150 m2 cubiertos aproximadamente y 50 m2 semi cubiertos, aproximadamente.\r\n\r\nA pocos metros de la casa se encuentra un departamento de unos 40 m2 cubiertos, es mono ambiente, y cuenta con baño.\r\n\r\nCuenta con servicio de Electricidad. Estado de títulos: Escritura.\r\n\r\nLa propiedad tiene una muy buena proyección, con posibilidad de alquilar una unidad durante la temporada turística y teniendo la opción de anexar más unidades.\r\n\r\nNo deje de visitar este inmueble, interesante opción para quien busca realizar un cambio de vida.\r\n\r\n<strong>Precio de Venta: DÓLARES ESTADOUNIDENSES CIENTO CINCUENTAMIL (U$S 150.000.-). </strong>\r\n\r\nContacto:\r\n\r\nTel. 03544-15431582\r\n\r\nC.P.I. Esteban Urús.  M.P. 4448.\r\n\r\n&nbsp;', 'V18- Importante casa con cabaña en V. Cura Brochero.', '', 'draft', 'closed', 'closed', '', 'v18-importante-casa-con-cabana-cura-brochero', '', '', '2017-08-28 19:14:08', '2017-08-28 22:14:08', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1217', 0, 'post', '', 0),
