(1227, 1, '2015-07-31 11:02:43', '2015-07-31 14:02:43', 'Se vende casa de dos dormitorios San Lorenzo. Ubicada en un terreno de 2.040 m2 de superficie. Interesante opción de inversión en zona tranquila. Ubicada a 270 metros aprox. del Arroyo Toro Muerto.\r\n\r\nEl inmueble se encuentra ubicado en cercanías al arroyo Toro Muerto, en una zona con características rurales perteneciente a la Comuna de San Lorenzo, a sólo 1.600 metros del asfalto y a 5,2 Km. de V. Cura Brochero y a 7,5 Km. de Mina Clavero. La zona ha tenido un importante crecimiento en los últimos años. El terreno tiene 51 metros de frente sobre un Pasaje, y una superficie de 2.040 m2 aproximadamente.\r\n\r\nTiene construida una casa con la siguiente distribución: estar-comedor, cocina, dos dormitorios y un baño. La casa tiene detalles de terminación y se le pueden realizar algunas mejoras. Tiene 90 m2 cubiertos aproximadamente.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias.\r\n\r\nLa zona es tranquila, con cercanía al río y contacto con la naturaleza. Ideal para realizar un cambio de vida en Traslasierra!!\r\n\r\n<strong>Precio de Venta: $ 530.000.- (PESOS QUINIENTOS TREINTA MIL). </strong>\r\n\r\nContacto:\r\n\r\nTel. 03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448.', 'V19- Casa de dos dormitorios en San Lorenzo.', '', 'draft', 'closed', 'open', '', 'v19-casa-dos-dormitorios-san-lorenzo', '', '', '2016-08-29 17:34:00', '2016-08-29 20:34:00', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1227', 0, 'post', '', 0),
