(1256, 1, '2015-09-11 19:23:57', '2015-09-11 22:23:57', 'Se vende llave de negocio de venta de recuerdos y artesanías con casi 15 años de trayectoria comprobable. Ubicado en importante avenida de Mina Clavero. Si está buscando un negocio familiar con destacado renombre en la zona, no deje de consultar por esta opción!!\r\n\r\n&nbsp;\r\n\r\nLa entrega de la llave del negocio incluye: Página Web, con administración de la misma. Cuenta de Facebook y mail. Cartera de 400 proveedores. Muebles y exhibidores del negocio y más de 60 metros lineales de estanterías. Dos equipos de aire acondicionado de 6.000 frigorías cada uno más una cortina de aire. Carteles identificadores del negocio (10). Sistema de administración informático (con historial de 5 años). Tres computadoras completas y una impresora. Cartera de clientes con 15 años de trayectoria comprobable, que ha convertido este negocio en una referencia en artesanías y recuerdos en todo el valle.\r\n\r\nEl local comercial que se alquila es esquina con 11 metros de frente por 8 metros de fondo, más un baño y 2 depósitos, uno de 5 m por 8 m y el otro de 1,5 m por 4 m.\r\n\r\nLa cantidad de mercadería es a balance, y tiene un margen de variación según la cantidad. Este punto debe desarrollarse personalmente con el interesado.\r\n\r\nExiste la posibilidad de entregar el negocio hasta fines de Octubre, de lo contrario la entrega podrá realizarse en Marzo próximo.\r\n\r\nSi Ud. está considerando la opción de vivir en forma permanente en Traslasierra y particularmente en la zona de Mina Clavero, y busca un negocio con muy buena rentabilidad y mejor proyección, no debe dejar de considerar esta excelente opción!!!\r\n\r\nPrecio Llave:……………….…PESOS QUINIENTOSMIL ($500.000.-).\r\n\r\nPrecio de Alquiler Local:…….PESOS NUEVEMIL ($9.000.-) por mes.\r\n\r\nMercadería: Detalles sólo personalmente.\r\n\r\nComisión inmobiliaria: 10 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nC.P.I. Esteban Urús. M.P.Nº4448.', 'Negocio de venta de  Artesanías con excelente rentabilidad!!!', '', 'publish', 'closed', 'open', '', 'negocio-venta-artesanias-con-excelente-rentabilidad', '', '', '2015-09-11 19:23:57', '2015-09-11 22:23:57', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1256', 0, 'post', '', 0),
