(1280, 1, '2015-11-18 19:41:28', '2015-11-18 22:41:28', 'Se vende terreno de 1 Ha., con 128 metros de frente sobre la Ruta Prov. Nº 14, frente al acceso a la zona conocida como “Bajo del Molino”, en Nono. A 1 km. del río Chico. Ideal para proyecto comercial, debido al tránsito que allí circula todo el año.\n\nPara acceder al lote, partiendo desde el centro de Nono, se recorren por la Ruta Prov. Nº14 1,9 km. hacia el Sur. Frente al mismo se encuentra un refugio para esperar colectivos y nace el camino para “Bajo del Molino”, una zona de casas quintas y complejos de cabañas.\n\nEl terreno es rectangular, con 128 metros de frente, igual contrafrente, 74 metros de fondo en el lado Norte y 78.5 metros de fondo en el límite Sur. Suma 1 Ha. de superficie. Es llano con tierra, sin superficies rocosas y tiene árboles autóctonos de distintos tamaños. Se encuentra amojonado y tiene alambrado (por mejorar) el frente. No están alambrados el fondo ni los laterales.\n\nEl agua se encuentra a 20 metros de profundidad aproximadamente. El cableado de Electricidad pasa por el frente.\n\nEstado de Títulos: Escritura de Dominio.\n\nEste lote es una opción única como reserva de valor ya que está proyectado realizar un nuevo acceso a Nono por el lado Sur, en cercanías a este inmueble. Ideal para una importante variedad de proyectos comerciales (hotel, complejo de cabañas, locales comerciales, etc.), debido al importante movimiento vehicular que pasa por su frente todo el año, sumando el plus que generan las temporadas turísticas. Inversión segura en Traslasierra!!!\n\n&nbsp;\n\n&nbsp;\n\n<b>Precio: PESOS CIENTO NOVENTA POR CADA METRO CUADRADO. ($190.- x c/m2)</b>\n\n<b> </b>\n\nComisión inmobiliaria: 5 %\n\n&nbsp;\n\nTel.03544-15431582\n\nC.P.I. Esteban Urús.\n\nM. P. 4448.\n\n<b> </b>', 'T12- 1 Hectárea frente a la Ruta en Nono', '', 'inherit', 'closed', 'closed', '', '793-autosave', '', '', '2015-11-18 19:41:28', '2015-11-18 22:41:28', '', 793, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/793-autosave/', 0, 'revision', '', 0),
(1281, 1, '2015-11-24 11:27:39', '2015-11-24 14:27:39', '&nbsp;\r\n\r\nSe venden casa y departamento ubicados en tranquilo barrio de V. Cura Brochero, a 7 cuadras de la plaza Centenario y del centro comercial. Correcto estado de conservación. Interesante opción!!\r\n\r\n&nbsp;\r\n\r\nEste inmueble está ubicado en Villa Cura Brochero, a 400 metros de la Avenida Belgrano y a 10 cuadras del río Panaholma. La vivienda fue construida sobre un terreno rectangular con 13 metros de frente por 38 metros aprox. de fondo, sumando una superficie aproximada de 474,6 m2. Todo su perímetro está cerrado. Cuenta con un departamento que da al frente con una cocina comedor, dos dormitorios y un baño. Por un lateral se ingresa hacia el fondo, donde se encuentra la casa, también con cocina comedor, un baño y dos dormitorios.\r\n\r\n&nbsp;\r\n\r\nInteresante opción para adquirir en zona tranquila, con opción a contar con unidad para alquilar.\r\n\r\n&nbsp;\r\n\r\nPrecio: PESOS OCHOCIENTOS CINCUENTA MIL ($ 850.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448\r\n\r\n&nbsp;', 'V22- Casa con departamento en V. Cura Brochero.', '', 'draft', 'closed', 'closed', '', 'v22-casa-con-departamento-cura-brochero', '', '', '2017-04-21 10:46:36', '2017-04-21 13:46:36', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1281', 0, 'post', '', 0),
