(1289, 1, '2015-11-25 12:22:53', '2015-11-25 15:22:53', 'Se vende casa de 2 dormitorios ubicada en tranquilo barrio de Mina Clavero, en amplio lote de 600 m2. Depto. a terminar en 1er piso. A sólo 600 metros del río Mina Clavero.\r\n\r\n&nbsp;\r\n\r\nEste inmueble tiene frente sobre la calle Olmos, en un barrio tranquilo y familiar, a 540 metros aprox. de la Av. San Martín y a 650 metros del Casino.\r\n\r\nLa vivienda fue construida sobre un terreno de 600 m2, con forma rectangular con un frente de 15 metros por 40 metros de fondo. La construcción fue realizada con nobles materiales de construcción. La casa tiene 61,54 m2 cubiertos.\r\n\r\nEn el frente tiene un porch, se ingresa a un estar comedor, a la derecha se ingresa a la cocina, a la izquierda se encuentran las dos puertas de acceso a los dormitorios. También desde la cocina comedor se ingresa al baño. Continuando por la cocina, se accede al lavadero.  En la parte trasera y con una bella vista de las sierras, se encuentra una galería. Tanto los pasillos como las habitaciones son amplios y luminosos, con muy buenas aberturas. La casa tiene un diseño moderno que la hace muy atractiva.\r\n\r\nSubiendo por una escalera en el lateral de la casa (ingreso independiente), se accede a un departamento a medio construir (paredes hasta la altura del techo).\r\n\r\nEstado de títulos: Consultar.\r\n\r\nEl estado general de la vivienda es muy bueno, en condiciones para habitar. Es una casa muy interesante considerando los metros cubiertos, el amplio lote y la cómoda ubicación.\r\n\r\n&nbsp;\r\n\r\nPrecio: DOLARES ESTADOUNIDENSES NOVENTAMIL (U$S 90.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V23- Casa de 2 dormitorios con un dpto. en construcción.', '', 'draft', 'closed', 'closed', '', 'v23-casa-dormitorios-con-dpto-construccion', '', '', '2017-04-21 10:40:35', '2017-04-21 13:40:35', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1289', 0, 'post', '', 