(1298, 1, '2016-03-22 19:07:05', '2016-03-22 22:07:05', 'Se vende casa de 2 dormitorios ubicada en tranquilo barrio de Mina Clavero, en amplio lote de 600 m2. Depto. a terminar en 1er piso. A sólo 600 metros del río Mina Clavero.\n\n&nbsp;\n\nEste inmueble tiene frente sobre la calle Olmos, en un barrio tranquilo y familiar, a 540 metros aprox. de la Av. San Martín y a 650 metros del Casino.\n\nLa vivienda fue construida sobre un terreno de 600 m2, con forma rectangular con un frente de 15 metros por 40 metros de fondo. La construcción fue realizada con nobles materiales de construcción. La casa tiene 61,54 m2 cubiertos.\n\nEn el frente tiene un porch, se ingresa a un estar comedor, a la derecha se ingresa a la cocina, a la izquierda se encuentran las dos puertas de acceso a los dormitorios. También desde la cocina comedor se ingresa al baño. Continuando por la cocina, se accede al lavadero.  En la parte trasera y con una bella vista de las sierras, se encuentra una galería. Tanto los pasillos como las habitaciones son amplios y luminosos, con muy buenas aberturas. La casa tiene un diseño moderno que la hace muy atractiva.\n\nSubiendo por una escalera en el lateral de la casa (ingreso independiente), se accede a un departamento a medio construir (paredes hasta la altura del techo).\n\nEstado de títulos: Consultar.\n\nEl estado general de la vivienda es muy bueno, en condiciones para habitar. Es una casa muy interesante considerando los metros cubiertos, el amplio lote y la cómoda ubicación.\n\n&nbsp;\n\nPrecio: DOLARES ESTADOUNIDENSES NOVENTAMIL (U$S 88.500.-).\n\nComisión Inmobiliaria: 3%\n\n03544-15431582\n\nC.P.I. Esteban Urús.\n\nM.P. 4448', 'V23- Casa de 2 dormitorios con un dpto. en construcción.', '', 'inherit', 'closed', 'closed', '', '1289-autosave', '', '', '2016-03-22 19:07:05', '2016-03-22 22:07:05', '', 1289, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1289-autosave/', 0, 'revision', '', 0),
(1301, 1, '2015-12-10 11:36:06', '2015-12-10 14:36:06', 'Se vende dúplex en Mina Clavero, ubicado a 130 metros del río Mina Clavero. El terreno tiene 370 m2.\r\n\r\n&nbsp;\r\n\r\nEl barrio se caracteriza por un ambiente familiar conjuntamente con proyectos turísticos como cabañas y hosterías; enriquecido por su cercanía al río. El terreno tiene frente 11,46 metros por 32 metros de fondo, con una superficie de 370 m2.\r\n\r\nLas dos unidades fueron construidas “en espejo” y cuentan (cada una), en Planta Baja con una galería de ingreso y luminosa cocina comedor. Por una escalera se accede a la Planta Alta, donde se encuentra el baño y los dos dormitorios. Entre las dos unidades suman en Planta Baja 48 m2 cubiertos y en Planta Alta 56,13 m2 cubiertos.\r\n\r\nCuenta con servicios de Agua de red, Electricidad, TV Cable, Recolección de Residuos, y factibilidad de Internet.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEl estado general de la vivienda es muy bueno, considerando que tiene aproximadamente 11 años de antigüedad, puede comprobarse una particular dedicación al mantenimiento del inmueble. Excelente opción para habitar y sumar una renta o como inversión como reserva de valor sumado a la renta que puede generar.\r\n\r\n&nbsp;\r\n\r\nPrecio: DÓLARES ESTADOUNIDENSES CIENTO QUINCEMIL (U$S 115.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V24- Se vende dúplex de 2 dormitorios.', '', 'publish', 'closed', 'closed', '', 'v24-duplex-dormitorios', '', '', '2018-12-21 11:34:09', '2018-12-21 14:34:09', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1301', 0, 'post', '', 0),
