(1310, 1, '2017-01-05 12:55:47', '2017-01-05 15:55:47', 'La fracción está ubicada en “El Salado”, a unos 1.200 metros de la plaza principal de Panaholma.Absoluta tranquilidad y hermoso paisaje.\n<p style="text-align: justify;">El entorno se caracteriza por alguna vivienda de vecinos permanentes, pero el área es rural, con arboleda autóctona.</p>\n<p style="text-align: justify;">Se venden 8 terrenos que varían entre 826 m2 a 1853 m2 de superficie. Por un lateral del loteo pasa un pintoresco arroyo que genera un bello paisaje.</p>\nEl servicio de Electricidad pasa por el frente y el agua se puede extraer de un arroyo contiguo o de un pozo a realizar en cada terreno. Caminando 200 metros por una  campo vecino, se accede al río Panaholma en un sector de playas con arena.\n\nEstado de Títulos: Derechos y Acciones Posesorias. Cumple perfectamente con requisitos para iniciar Usucapión.\n\nSon una interesante opción para construir una vivienda de fin de semana con posibilidades de alquilar en temporada o, adquiriendo más de una unidad, se puede pensar en un complejo de cabañas, en un entorno seguro y tranquilo.\n\n&nbsp;\n\nSUP. TERRENO           ESTADO            DETALLE\n\n&nbsp;\n\n&nbsp;\n\n6                   914.-     m2            Baldío              $ 120.000.-\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\nComisión inmobiliaria: 5 %\n\n&nbsp;\n\nTel.03544-15431582\n\nCorr. Inmb. Esteban Urús.\n\nMat. Nº4448.\n\n<b> </b>', 'T02 Fracción en Panaholma.', '', 'inherit', 'closed', 'closed', '', '548-autosave', '', '', '2017-01-05 12:55:47', '2017-01-05 15:55:47', '', 548, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/548-autosave/', 0, 'revision', '', 0),
(1311, 1, '2015-12-22 11:43:24', '2015-12-22 14:43:24', 'Se venden casa y departamento ubicados en lote esquina sobre asfalto frente a la plaza de Panaholma, a 240 metros del río. Tranquilidad asegurada. Oportunidad para aprovechar!!\r\n\r\nLa casa y el depto. se encuentran frente a la plaza, donde hay algunos locales comerciales, la iglesia, policía, parada de ómnibus; todo enmarcado en la tranquilidad del pueblo serrano. El terreno esquina tiene 9 metros por 18 metros, sumando 160 m2 aproximadamente.\r\n\r\nCuenta con una casa y un departamento, que suman aproximadamente 87 m2 cubiertos; con la siguiente distribución: Casa: galería, parrilla, cocina-comedor, 2 dormitorios, baño. Departamento: parrilla, galería, cocina-comedor, un dormitorio y un baño. Ambas unidades cuentan con cocheras semi-cubiertas.\r\n\r\nCuenta con agua de red y electricidad. Estado de títulos: Consultar.\r\n\r\nEste inmueble es ideal para quien desee vivir en un lugar tranquilo, con contacto con la naturaleza, aunque con acceso a servicios y en una pequeña comunidad serrana. El río Panaholma da un marco único a este poblado, que cambia su perfil durante la temporada turística. También puede considerarse como vivienda de fin de semana con opción a alquilar la otra unidad. Ideal inversión como reserva de valor considerando su excelente ubicación.\r\n\r\nPrecio: <strong>DOLARES ESTADOUNIDENSES CUARENTA MIL. (U$S 40.000.-).</strong>\r\n\r\nContacto: C.P.I. Esteban Urús M.P. 4448\r\n\r\nTel: 03544-15-431582\r\n\r\nE-mail: info@/localhost/28._edificarinmobiliaria/\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'V25- Casa y Depto. frente a plaza de Panaholma', '', 'publish', 'closed', 'closed', '', 'v25-casa-depto-frente-plaza-panaholma', '', '', '2018-12-21 10:45:05', '2018-12-21 13:45:05', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1311', 0, 'post', '', 0),
