(1320, 1, '2015-12-30 13:29:02', '2015-12-30 16:29:02', 'Se vende casa de tres dormitorios, con piscina en Mina Clavero!!\n\nEste barrio se encuentra en la zona Sur de Mina Clavero; ha tenido un importante crecimiento en los últimos años con nuevas viviendas y complejos de cabañas. El nuevo Hospital Regional de Mina Clavero, se encuentra a 6 cuadras. Se encuentra a 200 mtrs. de la Ruta Provincial Nº14, y a 12 cuadras de la división de las Avenidas Mitre y San Martín, donde comienza el centro comercial de Mina Clavero. El río Los Sauces con sus amplias playas de arena se encuentra a 600 metros de distancia aproximadamente.\n\nEl terreno es rectangular, con 10 metros de frente e igual medida en su contrafrente por 30 metros de fondo, sumando aproximadamente 300 m2 de superficie.\n\nLa construcción de 95 m2 de superficie, tiene una antigüedad de 5 años. Está construida con materiales de muy buena calidad. Cuenta con living, cocina, comedor, tres dormitorios y un baño. También tiene una galería que se utiliza como cochera techada y un  lavadero semicubierto. Tiene una piscina. Se encuentra en muy buen estado de conservación. La casa cuenta con servicios de Electricidad, Agua Potable de Red, Recolección de Residuos, (con opción a TV Cable, Teléfono e Internet).\n\nEstado de Títulos: Escritura de Dominio.\n\nUbicada en una zona tranquila, aunque cerca del río Los Sauces y con fácil acceso al centro es una interesante opción para disfrutar en vacaciones o como vivienda permanente.\n\n<strong>Precio de Venta: $ 950.000.- (PESOS NOVECIENTOSCINCUENTA MIL). </strong>\n\nContacto:\n\nTel. 03544-15431582\n\nC.P.I. Esteban Urús.\n\nM.P. 4448.', '', '', 'inherit', 'closed', 'closed', '', '1247-autosave', '', '', '2015-12-30 13:29:02', '2015-12-30 16:29:02', '', 1247, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1247-autosave/', 0, 'revision', '', 0),
(1321, 1, '2018-10-22 19:23:25', '2018-10-22 22:23:25', '&nbsp;\n\nUbicado en San Lorenzo, a 1.300 metros de la rotonda que lo une con V. Cura Brochero ya 3 km del centro de Mina Clavero, con acceso sobre el asfalto, se encuentra “El Alto de San Lorenzo”. Vista panorámica. Excelente opción de inversión.\n\nLa amplitud de las parcelas, los paisajes panorámicos, la cercanía a las ciudades y los balnearios, conjuntamente con  poder disfrutar de la naturaleza, son conceptos básicos considerados en “El Alto”. Cuenta con una amplia avenida de acceso de más de 21 metros de ancho, tres plazas de 5.000 m2 cada una,  estratégicamente ubicadas. Este proyecto considera poder disfrutar de una vida o vacaciones en familia, sin perder los formidables paisajes, demorando menos de 5 minutos hasta Cura Brochero o Mina Clavero, por asfalto.\n\nServicio de Electricidad\n\nEstado de títulos: Derechos y Acciones Posesorias en condiciones para iniciar Usucapión.\n\nEl lugar es ideal para planificar tanto una vivienda familiar como un complejo de cabañas, ya que el entorno asegura tranquilidad. Visite personalmente esta opción y enamórese de Traslasierra!!\n\n&nbsp;\n\nPrecio de Venta:\n\n<strong>Desde $275.- por m2.- (PESOS DOSCIENTOS SETENTA Y CINCO POR METRO CUADRADO). </strong>\n\n<strong>    Promoción: Desde $258.- por m2.- (Pago Contado Efectivo).</strong>\n\n&nbsp;\n\nComisión inmobiliaria: 5 %\n\nContacto:\n\nTel.03544-15431582\n\nwww./localhost/28._edificarinmobiliaria/\n\nC.P.I. Esteban Urús. M.P. Nº4448.', 'T 22 - PARCELAS DESDE 1.000 M2 EN “EL ALTO DE SAN LORENZO”', '', 'inherit', 'closed', 'closed', '', '1158-autosave', '', '', '2018-10-22 19:23:25', '2018-10-22 22:23:25', '', 1158, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1158-autosave/', 0, 'revision', '', 0),
(1322, 1, '2016-01-08 12:13:34', '2016-01-08 15:13:34', 'Se vende casa ubicada en tranquilo barrio residencial de Cura Brochero, cerca del río Panaholma y cerca del centro comercial. Interesante opción como reserva de valor!!\r\n\r\n&nbsp;\r\n\r\nEste inmueble está ubicado en Villa Cura Brochero, a 200 metros del río Panaholma. Se encuentra a 450 metros de la plaza principal de Cura Brochero.\r\n\r\nLa vivienda fue construida sobre un terreno con 18 metros de frente y suma una superficie según plano de 609,5 m2. Todo su perímetro está cerrado y se encuentra parquizado con unos pinos de buen porte. La vivienda de unos 42 m2 cubiertos aproximadamente y 18 m2 semi cubiertos aproximadamente, cuenta con cochera con techo de losa, cocina comedor, dos dormitorios y un baño. Necesita algunas mejoras y acondicionamientos. Accediendo por una escalera, se ingresa a un monoambiente independiente, cuenta aproximadamente con 24 m2 cubiertos. Hay que rehacer el baño y mejorar las instalaciones para la cocina. Se deben chequear las instalaciones de agua de red, electricidad y sanitarias. Debajo del monoambiente se encuentra un sótano, con una igual superficie, con problemas de humedad que pueden ser tratados. En el acceso del sótano hay una galería con postes y techo de madera.\r\n\r\nEstado de Título: Escritura, aunque hay que finalizar una Declaratoria de Herederos.\r\n\r\nInteresante opción para  restaurar, actualizando la construcción existente.\r\n\r\n&nbsp;\r\n\r\nPrecio: PESOS OCHOCIENTOS CINCUENTAMIL  ($ 850.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448\r\n\r\n&nbsp;', 'V27- Casa con Departamento en V. Cura Brochero.', '', 'draft', 'closed', 'closed', '', 'v27-casa-con-departamento-cura-brochero', '', '', '2018-10-19 10:06:02', '2018-10-19 13:06:02', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1322', 0, 'post', '', 0),
