(1331, 1, '2016-01-15 12:01:53', '2016-01-15 15:01:53', 'Se vende chacra de 2,3 Has. aproximadamente con frente sobre la Ruta Prov. Nº 15, ubicada a 14,5 km. hacia el Norte de Villa Cura Brochero.\r\n\r\n&nbsp;\r\n\r\nLa superficie es llana, con agradable paisaje, la zona es muy tranquila.\r\n\r\nCuenta con una casa de 90 m2 cubiertos aprox., cuenta con galería, ingreso tipo living, cocina comedor, 3 dormitorios, lavadero cubierto, baño. Se le pueden realizar algunas mejoras. Con la casa se comunica un galpón de aproximadamente 60 m2 cubiertos. También cuenta con una pequeña habitación donde se encuentra el tanque de agua. Agua y Electricidad trifásica.\r\n\r\nLa parcela cuenta con Escritura, aunque está pendiente una subdivisión de una fracción de la misma.\r\n\r\nInteresante inmueble para quien decida alejarse de las ciudades y emprenda una nueva vida en las sierras.\r\n\r\n&nbsp;\r\n\r\n<u>Precio de Venta</u>: <strong>PESOS UN MILLÓN NOVECIENTOS MIL ($1.900.000.-).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nContacto: 03544-15431582.\r\n\r\nC.P.I. Esteban Urús.  M.P. 4448\r\n\r\n&nbsp;', 'C09- Se vende Chacra con Casa de 3 Dormitorios', '', 'draft', 'closed', 'closed', '', 'c09-vende-chacra-con-casa-dormitorios', '', '', '2018-11-12 11:44:42', '2018-11-12 14:44:42', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1331', 0, 'post', '', 0),
