(1341, 1, '2016-01-16 11:45:39', '2016-01-16 14:45:39', 'Se vende casa ubicada en tranquilo barrio residencial de Cura Brochero, ubicada frente al nuevo Santuario del Cura Brochero, en etapa final de construcción. Oportunidad de compra!!\r\n\r\n&nbsp;\r\n\r\nEste inmueble está ubicado en Villa Cura Brochero, a 180 metros del río Panaholma. Se encuentra a 400 metros de la plaza principal de Cura Brochero.\r\n\r\nLa vivienda fue construida sobre un terreno esquina con más de 50 metros de frente y suma una superficie según plano de 808 m2. Todo su perímetro está cerrado y se encuentra parquizado con árboles de buen porte. La vivienda de unos 51 m2 cubiertos aproximadamente y 16 m2 semi cubiertos aproximadamente, cuenta con cocina comedor, un dormitorio y un baño. Necesita algunas mejoras y acondicionamientos.\r\n\r\nCuenta con servicios de Agua de Red, Electricidad, Recolección de Residuos, y posibilidad de Internet. Estado de Título: Escritura.\r\n\r\nEste inmueble tiene una atractiva proyección debido a que se encuentra frente al nuevo Santuario con hospedaje, dedicado al Cura Brochero, lo que en el futuro debería generar un interesante movimiento de turistas.\r\n\r\n&nbsp;\r\n\r\nPrecio: PESOS UN MILLÓN TRESCIENTOS MIL  ($ 1.300.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448\r\n\r\n&nbsp;', 'V28- Casa con piscina en Cura Brochero.', '', 'draft', 'closed', 'closed', '', 'v28-casa-con-piscina-cura-brochero', '', '', '2017-04-22 12:37:24', '2017-04-22 15:37:24', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1341', 0, 'post', '', 0),
