(1350, 1, '2016-02-04 11:25:23', '2016-02-04 14:25:23', 'Ubicado en Arroyo de los Patos, a 160 metros aprox. de la Ruta Prov. Nº14 y a 550 metros aprox. del río Los Sauces. Cuenta con piscina y quincho. Interesante opción para quien busque un cambio de vida en zona tranquila de Traslasierra.\r\n\r\nLas cabañas se encuentran en un sector caracterizado por la actividad de alquiler temporario, a pocos metros de la Ruta Prov.\r\n\r\n&nbsp;\r\n\r\nEl terreno tiene una forma rectangular, con 16,55 metros de frente, el mismo contrafrente y 61 metros de fondo, sumando una superficie de 1.009 m2. Es llano y con tierra de buena calidad. En el mismo podemos encontrar árboles de buen porte que generan una fresca sombra en los meses de alquiler.\r\n\r\nTiene dos cabañas con cocina comedor, dos dormitorios, un baño y cochera techada. Se diferencian en la superficie cubierta. El Monoambiente con baño también se puede alquilar. También tiene un quincho y una piscina con solárium  y equipo de filtrado. Todas las unidades se entregan listas para alquilar, con muebles, vajilla, etc.\r\n\r\nTodas las instalaciones, la forestación y el parque se encuentran en muy buen estado de mantenimiento.\r\n\r\nEstado de Títulos: Escritura.\r\n\r\nEste inmueble permite generar ingresos y vivir todo el año en contacto con la naturaleza, en un barrio tranquilo!\r\n\r\n<strong>Precio: DOLARES ESTADOUNIDENSES CIENTO NOVENTA MIL (U$S 190.000.-).</strong>\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nTel.:03544-15431582.\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús. M.P. 4448', 'N08- Dos Cabañas con Monoambiente.', '', 'publish', 'closed', 'closed', '', 'n08-dos-cabanas-con-monoambiente', '', '', '2017-04-08 10:08:11', '2017-04-08 13:08:11', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1350', 0, 'post', '', 0),
