(1371, 1, '2016-02-24 12:00:27', '2016-02-24 15:00:27', 'Se vende casa antigua con un departamento y habitaciones para alquilar, cerca del centro en Mina Clavero. Ubicada a pocas cuadras del centro comercial!\r\n\r\n&nbsp;\r\n\r\nEl terreno tiene aproximadamente 750 m2 con forma de “L”. La vivienda tiene un dormitorio, cocina comedor y baño. Cruzando un pasillo, se encuentran dos habitaciones dobles con baño privado. Saliendo al patio, se encuentra una habitación para un administrador.\r\n\r\nLa construcción necesita algunas mejoras y mantenimiento.\r\n\r\nEstado de títulos: Consultar.\r\n\r\nPrecio: Consultar.', 'V29- Casa en venta en M. Clavero.', '', 'draft', 'closed', 'closed', '', 'v29-casa-con-opcion-alquiler-clavero', '', '', '2018-04-12 17:25:14', '2018-04-12 20:25:14', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1371', 0, 'post', '', 0),
