(1376, 1, '2016-02-24 12:15:25', '2016-02-24 15:15:25', 'Si busca una casa con opción a tener unidades de alquiler, esta puede ser una opción interesante, con una excelente relación entre el costo y las características del inmueble.\r\n\r\n&nbsp;\r\n\r\nEl inmueble está ubicado en barrio residencial, a 8 cuadras del centro histórico y comercial de Villa Cura Brochero, caracterizado por su tranquilidad y cercanía al río Panaholma, en el sector con amplias playas, denominado “Costa Azul”. El terreno es rectangular con un frente de 11 metros por un fondo de 27,50 metros, con una superficie de 302,5 m2. El lote es llano y con tierra, sin superficies rocosas.\r\n\r\nHacia el frente del terreno se encuentra una casa con dos dormitorios, un baño y cocina comedor; tiene aproximadamente 60 m2 cubiertos. Hacia el sector posterior se encuentran dos monoambientes, uno en planta baja y el otro en un primer piso. Cada uno tiene 25 m2 cubiertos aproximadamente.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEste inmueble es una opción que debe ser visitada por quien busque una casa bien ubicada, con unidades para recibir visitas o alquilar.\r\n\r\n&nbsp;\r\n\r\nPrecio de Venta: DÓLARES ESTADOUNIDENSES NOVENTAYOCHOMIL<strong> (U$S 98.000.-).</strong>\r\n\r\n<strong> </strong>\r\n\r\nContacto: C.P.I. Esteban Urús. M.P. 4448.\r\n\r\nTel. 03544-15-431582\r\n\r\n&nbsp;', 'V30- Se vende Casa con dos Departamentos', '', 'publish', 'closed', 'closed', '', 'v30-vende-casa-con-dos-departamentos', '', '', '2018-03-15 11:35:06', '2018-03-15 14:35:06', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1376', 0, 'post', '', 0),
