(1385, 1, '2016-03-10 18:51:25', '2016-03-10 21:51:25', 'Se venden dos casas en barrio tranquilo, con acceso independiente; inversión ideal para renta anual o temporaria.\r\n\r\n&nbsp;\r\n\r\nEl inmueble está ubicado en barrio residencial, a 450 metros de la plaza principal de Mina Clavero. El terreno es rectangular con un frente de 10 metros por un fondo de 20 metros, con una superficie de 202,3 m2. El lote es llano y sin superficies rocosas, la calle del frente está asfaltada.\r\n\r\nCuenta con dos casas con dormitorios, baño y cocina comedor; entre ambas suman aproximadamente 80 m2 cubiertos. El estado general es bueno y están listas para habitar, aunque se le pueden realizar algunas mejoras. Cuenta también con cochera semicubierta.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nInteresante opción cerca del centro de Mina Clavero, para utilizar como vivienda permanente, con la opción de alquilar.\r\n\r\n&nbsp;\r\n\r\nPrecio de Venta: <strong>DÓLARES ESTADOUNIDENSES OCHENTAMIL  (U$S 80.000.-).</strong>\r\n\r\n<strong> </strong>\r\n\r\nContacto: C.P.I. Esteban Urús. M.P. 4448.\r\n\r\nTel. 03544-15-431582', 'V31- 2 Casas en Mina Clavero.', '', 'publish', 'closed', 'closed', '', 'v31-casas-mina-clavero', '', '', '2018-10-19 10:56:16', '2018-10-19 13:56:16', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1385', 0, 'post', '', 0),
