(1420, 1, '2016-05-28 11:22:58', '2016-05-28 14:22:58', 'Se alquila local apto para pub, bar o café, con acceso sobre la Avenida San Martín de Mina Clavero. El local tiene una agradable vista de la plaza principal de Mina Clavero, ya que se encuentra en un primer piso y dispone de balcón.\r\n\r\nEl local cuenta con una escalera de acceso, tiene 85 m2 cubiertos aproximadamente. La capacidad dependerá de la disposición de mesas que se realice. Se puede alquilar libre de todo mobiliario, o con algunos/todos los mobiliarios y artículos que lo conforman. Obviamente estas distintas opciones, modificarán el precio de renta.\r\n\r\nCuenta con dos baños, para damas y caballeros, y una cocina cómoda con heladera, horno, un frezeer, y dos heladeras exhibidoras.\r\n\r\nSe requiere como requisito garantía inmobiliaria.\r\n\r\nPara conocer detalles del alquiler, no dude en consultar.\r\n\r\n<strong> </strong>\r\n\r\n<strong>Precio Mensual: Consultar. </strong>\r\n\r\n&nbsp;\r\n\r\nContacto: 03544-15431582.\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P.4448', 'A05- Se alquila Local comercial. Acceso Av. San Martín.', '', 'private', 'closed', 'closed', '', 'a05-alquila-local-comercial-acceso-san-martin', '', '', '2016-11-18 11:10:00', '2016-11-18 14:10:00', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1420', 0, 'post', '', 0),
