(1429, 1, '2016-06-07 09:41:39', '2016-06-07 12:41:39', 'Se vende casa de 140 m2 aprox. con hermosa vista panorámica de las Altas Cumbres y el valle de Traslasierra. Amplio terreno.\r\n\r\nCasa ubicada en Los Hornillos, en un tranquilo barrio residencial, a 150 metros de la Ruta Prov. Nº 14. Cuenta con dos terrenos que suman una superficie de 1.861 m2 aprox. Está cercado con un cerco de piedras y alambrado. Es llano y se encuentra totalmente parquizado. Cuenta con árboles de distintas especies, incluyendo frutales.\r\n\r\nLa construcción se encuentra en un muy buen estado de conservación gracias a la continua dedicación de sus propietarios por el inmueble. La distribución es: cocina-comedor, dos baños, tres dormitorios, una cochera cubierta, una galería con deck de madera, ideal para apreciar el paisaje. También cuenta con pileta.\r\n\r\nCuenta con servicio de Agua de Red y Electricidad.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEste inmueble es ideal para quien quiera contacto con la naturaleza con una bella vista de las sierras, manteniendo las comodidades de una ciudad. Con fácil acceso, el lote es muy íntimo y amplio. Debido a la tranquilidad y el excelente clima de Los Hornillos, se puede utilizar como vivienda permanente o de fin de semana con la posibilidad de alquilarla los días que no la use en el verano.\r\n\r\n<strong>Precio de Venta: U$S 130.000.- </strong>\r\n\r\n<strong>(DOLARES ESTADOUNIDENSES CIENTO TREINTAMIL).</strong>\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nContacto:\r\n\r\nTel. 03544-15431582\r\n\r\nC.P.I. Esteban Urús.  M.P. 4448.', 'V32- Casa en Los Hornillos, vista panorámica!!', '', 'publish', 'closed', 'closed', '', 'v32-casa-los-hornillos-vista-panoramica', '', '', '2019-01-03 19:04:45', '2019-01-03 22:04:45', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1429', 0, 'post', '', 0),
