(1439, 1, '2016-06-11 11:14:32', '2016-06-11 14:14:32', 'Se vende casa  con bajada exclusiva al río Panaholma, en una zona tranquila y segura, es una opción irrepetible para quien desee vivir o vacacionar en un lugar paradisiaco en Traslasierra.\r\n\r\nEl inmueble está ubicado a 22 km. de Villa Cura Brochero y a 4,8 Km de la plaza principal del pueblo de Panaholma. En el lugar denominado Huatiquina, paraje denominado Segundo Vado, es una caserío con más de 30 casas. El terreno tiene una forma irregular y suma una superficie de 708 m2. Todo el perímetro se encuentra alambrado. Está parquizado y cuenta con una casita de madera para que jueguen niños, una cancha de bochas, frutales, una plataforma cerca del río para que sea cómodo tomar mates o pasar la tarde. También hay un pequeño galpón para guardar herramientas. Fuera del terreno se canalizó una pequeña corrida de agua y se realizó una plataforma con estructura de caños (techo de lona o media sombra) que sirve de cochera para 2 vehículos.\r\n\r\nLa casa tiene aproximadamente 68 m2 cubiertos. Cuenta con una pequeña galería de acceso con asador, cocina comedor (con pozo balde y horno de barroen su interior), 2 baños y 2 dormitorios (uno con baño en suite), cada dormitorio tiene espacios para muebles. El estado general de la casa es bueno, y se alquila todos los veranos.\r\n\r\nCuenta con agua pozo y electricidad. Estado de títulos: Escritura.\r\n\r\nEste inmueble es ideal para quien desee vivir o pasar partes del año en un lugar tranquilo, con contacto con la naturaleza y particularmente con el hermoso río Panaholma, con bajada a la hermosa playa que puede apreciarse en las fotos. El paisaje serrano es relajante. Lo invitamos a conocer personalmente este inmueble. Coordine una visita!!\r\n\r\n&nbsp;\r\n\r\nPrecio: <strong>PESOS UN MILLÓN CUATROCIENTOSMIL. ($1.400.000.-).</strong>\r\n\r\nContacto: C.P.I. Esteban Urús M.P. 4448\r\n\r\nTel: 03544-15-431582\r\n\r\nE-mail: info@/localhost/28._edificarinmobiliaria/\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'V33- Casa con bajada al río Panaholma', '', 'draft', 'closed', 'closed', '', 'v33-casa-con-bajada-rio-panaholma', '', '', '2017-04-21 10:45:21', '2017-04-21 13:45:21', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1439', 0, 'post', '', 0),
