(1460, 1, '2016-07-18 17:55:14', '2016-07-18 20:55:14', 'Se vende dúplex en Cura Brochero, ubicado a 220 metros de la Av. Belgrano. El terreno tiene 200 m2.\r\n\r\n&nbsp;\r\n\r\nEl barrio se caracteriza por un ambiente familiar y tranquilo. El terreno tiene un frente de 10,8 metros con una superficie de 200 m2.\r\n\r\nLas dos unidades fueron construidas “en espejo” y cuentan (cada una), en Planta Baja con una galería de ingreso y cocina comedor baño y dormitorio matrimonial, por una escalera se accede a la Planta Alta, donde se encuentra un dormitorio en entrepiso.\r\n\r\nCuenta con servicios de Electricidad, TV Cable, Recolección de Residuos, y factibilidad de Internet.\r\n\r\nEstado de títulos: Derechos y Acciones Posesorias.\r\n\r\nEl estado general de la vivienda es  bueno, y brinda la opción de alquiler deuna de las unidades.\r\n\r\n&nbsp;\r\n\r\nPrecio: PESOS UN MILLÓN ($1.000.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448\r\n\r\n&nbsp;', 'V34- Dúplex en Cura Brochero.', '', 'draft', 'closed', 'closed', '', 'v34-duplex-cura-brochero', '', '', '2018-01-17 12:57:58', '2018-01-17 15:57:58', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1460', 0, 'post', '', 0),
