(1469, 1, '2016-08-05 12:08:47', '2016-08-05 15:08:47', 'Ubicado en cercanías de Ciénaga de Allende, a 22 km. aprox. de Mina Clavero. Vertiente, dos sectores de chacra y lomadas suaves con vegetación autóctona.\r\n\r\n&nbsp;\r\n\r\nEl campo se encuentra al Oeste de Mina Clavero, recorriendo 11 km de asfalto por la Ruta Prov. Nº15, se atraviesa Villa Cura Brochero; y luego 11 Km de camino de tierra consolidado. Las 41,7 has. aprox. cuentan con una vivienda que se puede mejorar en su estado, conformado por con lomadas suaves con abundante vegetación autóctona y pasto, con sectores más rocosos que otros. Tiene una vertiente,  que nace en un campo lindero y que cruza el campo. En la casa hay un pozo de agua, y en otro sector del campo hay otro pozo que fue tapado. Hay dos sectores de chacras, uno cerca de la casa (2,5 Has aprox.) y otro más cerca de la parte posterior del campo (6 Has aprox.). El perímetro está alambrado, en algunos sectores necesita mantenimiento y mejoras. El tendido eléctrico se encuentra a 1.300 metros aprox. Estado de títulos: Derechos y Acciones Posesorias.   El campo no cuenta con un plano actualizado, deberá realizarse en caso de venta a cargo del comprador; la superficie es aproximada.\r\n\r\nEl campo tiene un interesante potencial con plantaciones, dadas sus características, por ejemplo de nogales, y también para ganadería.\r\n\r\n<u> </u>\r\n\r\n<u>Precio de Venta</u>:\r\n\r\n<strong>PESOS UN MILLÓN DOSCIENTOSMIL ($1.200.000.-). </strong>\r\n\r\nComisión inmobiliaria: 3 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. R. Esteban Urús.\r\n\r\nMat. Nº4448.', 'C10 - 41 Has. aprox. en Ciénaga de Allende', '', 'publish', 'closed', 'closed', '', 'c10-has-aprox-cienaga-allende', '', '', '2018-12-26 18:30:58', '2018-12-26 21:30:58', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1469', 0, 'post', '', 0),
