(1480, 1, '2016-09-13 11:20:41', '2016-09-13 14:20:41', 'Ubicados en Mina Clavero, en un sector residencial y tranquilo, se encuentra este desarrollo de alquiler, con atractiva proyección.\r\n\r\n&nbsp;\r\n\r\nEste inmueble se encuentra a 800 metros aprox. de la Av Mitre, con movimiento comercial todo el año y a unos 600 metros aprox. del río Los Sauces, que con amplias layas de arena, es una cita segura para los turistas que vienen a vacacionar.\r\n\r\nLas habitaciones son cómodas y están sobre un terreno de 509 m2 de superficie; encontrándose en el mismo predio una pileta y cocheras semi cubiertas, con cobertura de media-sombra. También cuenta con asadores. Ideales para el alquiler temporario, ya que con su ubicación son cómodos para los turistas. No deje de consultar para realizar una visita!!\r\n\r\n<strong>Precio: DÓLARES ESTADOUNIDENSES CIENTO SETENTAMIL  (U$S 170.000.-).</strong>\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nTel.:03544-15431582.\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús. M.P. 4448', 'N11- Seis Habitaciones con baño privado en Mina Clavero.', '', 'publish', 'closed', 'closed', '', 'n11-seis-habitaciones-con-bano-privado-mina-clavero', '', '', '2017-10-27 17:55:22', '2017-10-27 20:55:22', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1480', 0, 'post', '', 0),
