(1486, 1, '2016-09-26 20:06:52', '2016-09-26 23:06:52', 'Se vende  agradable casa en Mina Clavero a sólo 400 metros del río Los Sauces, en un sector con amplias playas de arena. Interesante opción!!\r\n\r\n&nbsp;\r\n\r\nEl barrio se caracteriza por viviendas residenciales, complejos de cabañas y distintos emprendimientos relacionados con la actividad turística. La casa se encuentra en un terreno esquina, con forma de “L” con 18,49 mtrs. aprox. en su frente Oeste y 26,19 mtrs. aprox.  en su frente Norte. Suma una superficie según plano de 608.28 m2. Se encuentra parquizado en su totalidad y cuenta con un quincho semicubierto. La casa tiene una antigüedad de 25 años aproximadamente, la caracteriza un diseño luminoso, de fácil ventilación y muy práctico para el uso cotidiano.\r\n\r\nLa distribución, en Planta Baja tiene estar-comedor, cocina, un dormitorio, baño y una amplia galería. En Planta Alta  cuenta con un cómodo escritorio/biblioteca, hay un segundo baño y dos dormitorios. Cuenta con 121,66 m2 cubiertos y 56,74 m2 semicubiertos.\r\n\r\nDispone de los servicios de Agua Potable de Red, Electricidad, TV Cable, Recolección de Residuos, asfalto, posibilidad de Internet.\r\n\r\nEstado de Títulos: Escritura.\r\n\r\nEl inmueble es ideal para quién busque un cambio de vida en una localidad tranquila, en un bello barrio cerca del río y cómoda con respecto al centro comercial. Una oportunidad para no dejar de visitar!!!\r\n\r\n&nbsp;\r\n\r\n<strong>Precio: PESOS UN MILLÓN SETECIENTOSMIL. ($1.700.000.-).</strong>\r\n\r\n&nbsp;\r\n\r\nContacto: C.P.I. Esteban Urús. Matrícula 4448.\r\n\r\nTel: 03544-15-431582.\r\n\r\nE-mail: info@/localhost/28._edificarinmobiliaria/', 'V35 - Cómoda casa con 3 dormitorios.', '', 'draft', 'closed', 'closed', '', 'v35-comoda-casa-con-dormitorios', '', '', '2016-11-19 11:22:55', '2016-11-19 14:22:55', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1486', 0, 'post', '', 0),
