(1498, 1, '2018-08-10 10:44:31', '2018-08-10 13:44:31', 'Ubicado en San Lorenzo, a 2.200 metros de la rotonda que lo une con V. Cura Brochero. Una excelente oportunidad, tranquilidad y paisaje serrano a cinco minutos del pueblo. El pequeño arroyo genera un ambiente único!!\n\n&nbsp;\n\nSe vende chacra de algo más de 1 Ha., lindera en un sector de aproximadamente 50 metros con un pequeño arroyo. La parcela tiene un sector llano o con un leve desnivel en su acceso, luego desciende hasta llegar al sector del pequeño arroyo. Tiene forma rectangular e irregular, rondando los 50 metros por 170 metros aproximadamente.\n\nSu forestación es típica de la zona, y el desnivel genera una hermosa vista panorámica de otros cerros bajos y de las Altas Cumbres. La tranquilidad es otra característica de esta zona.  Los servicios están previstos para dentro de tres años aproximadamente, comenzando por el Agua de Red.\n\nEstado de títulos: Derechos y Acciones Posesorias en condiciones para iniciar Usucapión.\n\nLa parcela es ideales para la construcción de una vivienda familiar o de fin de semana y también se puede proyectar allí el desarrollo de un emprendimiento relacionado con el turismo.\n\n<span style="text-decoration: underline;"> </span>\n\n<span style="text-decoration: underline;">Precio de Venta</span>: <strong> Superficie……10.935,58 M2 aprox…….U$S 50.000.-</strong>\n\n&nbsp;\n\n&nbsp;\n\nComisión inmobiliaria: 5 %\n\nContacto:\n\nTel.03544-15431582\n\nwww./localhost/28._edificarinmobiliaria/\n\nC.P.I. Esteban Urús. M.P. Nº4448.', 'T 23 -  SE VENDE PARCELA DE 1 HA CON  PEQUEÑO ARROYO', '', 'inherit', 'closed', 'closed', '', '1175-autosave', '', '', '2018-08-10 10:44:31', '2018-08-10 13:44:31', '', 1175, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1175-autosave/', 0, 'revision', '', 0),
(1499, 1, '2016-11-12 11:21:38', '2016-11-12 14:21:38', 'Se venden 8 Has. con casa de 3 dormitorios y 2 baños en Ambul. Ideal para tener un cambio de vida sin resignar comodidades!! Bella vista de las sierras!\r\n\r\nLa tranquila localidad de Ambul, ofrece una hermosa vista de las sierras con una gran tranquilidad todo el año. La chacra se encuentra en cercanías del pueblo, lo que otorga comodidad en el acceso a servicios y adquisición de insumos. El sector es de chacras, en el que abunda el verde y la forestación. Hay una 5 has. aproximadamente con forestación autóctona y unas 3 Has. aprox. son chacras. En ella se pueden criar animales de granja y hacer pequeños sembrados. Tiene alambrado casi todo el perímetro, restando unos 200 metros aproximadamente. Cuenta con dos corrales pequeños. Hay un Gallinero, quinta y árboles frutales. Hay un silo de cemento con unos 10.000 kgrs. de capacidad aproximadamente. También cuenta con un galpón de unos 40 m2 cubiertos aproximadamente. Cuenta con una piscina de 3 x 6 metros hecha de cemento.\r\n\r\nLa casa tiene aproximadamente dos años de antigüedad y 138 m2 aprox. entre cubiertos y semicubiertos. Tiene dos galerías, una en el frente y otra en el lateral Este, allí se encuentra la parrilla. En Planta Baja tiene la cocina, separada mediante una barra del estar-comedor, en el que se encuentra un agradable hogar a leña. Desde este ambiente se puede acceder al baño principal y a un dormitorio con baño en suite. Por una escalera se accede al Primer Piso, donde se encuentran dos dormitorios más. La casa tiene un diseño funcional y es luminosa.\r\n\r\nEn el frente se encuentra un local comercial de 7 x 3 metros aproximadamente.\r\n\r\nCuenta con servicio de electricidad y agua.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias.\r\n\r\nInteresante opción para realizar un cambio de vida, poder dedicarse a alguna producción intensiva y/o desarrollo de una granja.\r\n\r\n&nbsp;\r\n\r\nPrecio: PESOS TRES MILLONES OCHOCIENTOSMIL. ($3.800.000.-).\r\n\r\n&nbsp;\r\n\r\nContacto: CPI Esteban Urús. MP 4448.\r\n\r\nTel.:03544-15-434582.   E-mail: info@/localhost/28._edificarinmobiliaria/', 'C-11 Casa con pileta en 8 Has. Ambul.', '', 'publish', 'closed', 'closed', '', 'casa-con-pileta-has-ambul', '', '', '2018-02-26 10:48:28', '2018-02-26 13:48:28', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1499', 0, 'post', '', 0),
