(1508, 1, '2016-11-23 10:50:50', '2016-11-23 13:50:50', 'Se vende casa en Cura Brochero, ubicada en barrio tranquilo y residencial, cerca del río Panaholma.\r\n\r\n&nbsp;\r\n\r\nEl barrio se caracteriza por un ambiente familiar y con algunos inmuebles orientados al alquiler. Se encuentra a 300 metros aprox. del río Panaholma y a 1.100 metros aprox. de la plaza central, en la que se encuentra el centro histórico. El terreno es rectangular, con un frente de 12 metros, por 38.76 metros de fondo, generando una superficie de 465.12 m2 aprox. Es llano, sin superficies rocosas y tiene árboles  de buena sombra como un roble y también frutales.\r\n\r\nCuenta con una casa de 67 m2 cubiertos, con una antigüedad de aprox. 34 años. La distribución es: cocina-comedor, dos dormitorios, con una habitación más que fue transformada en un tercer dormitorio y un baño. También tiene un departamento a terminar con cocina-comedor con un dormitorio y un baño (se encuentra techado).\r\n\r\nCuenta con servicios de Electricidad, TV Cable, Recolección de Residuos, teléfono fijo y factibilidad de Internet.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEl estado general de la vivienda es  bueno, cuenta con un agradable terreno en una zona consolidada, cerca del centro; en un ambiente familiar.\r\n\r\n&nbsp;\r\n\r\nPrecio: PESOS UN MILLÓN DOSCIENTOS MIL ($1.200.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V36- Casa en Cura Brochero.', '', 'draft', 'closed', 'closed', '', 'v36-casa-cura-brochero', '', '', '2017-04-21 10:44:08', '2017-04-21 13:44:08', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1508', 0, 'post', '', 0),
