(1517, 1, '2016-12-16 10:45:09', '2016-12-16 13:45:09', 'Se vende amplia casa de 200 m2 aproximadamente más cómodo departamento. Ubicada en un terreno de 8.317 m2 de superficie. Opción de renta y de aumento de unidades!\n\nEl inmueble se encuentra en cercanías al barrio “La Antigua”, a 1.100 metros del río Panaholma, en V. Cura Brochero. La zona se caracteriza por construcciones de viviendas en los últimos años.\n\nEl terreno tiene una superficie de 8.317 m2 aproximadamente. Es llano y con tierra, a lo que se suma una amplia vista de las Altas Cumbres.\n\nLa casa tiene la siguiente distribución: Amplia cocina comedor con excelente iluminación natural y ventanales hacia las sierras, desde allí se ingresa a un pasillo por el que se accede primero a un dormitorio con baño en suite. Luego a un segundo dormitorio y finalmente a un baño de uso general. Los materiales utilizados son de muy buena calidad. Cuenta con una cómoda galería en forma de “L” que finaliza en un asador. Cuenta con 150 m2 cubiertos aproximadamente y 50 m2 semi cubiertos, aproximadamente.\n\nA pocos metros de la casa se encuentra un departamento de unos 40 m2 cubiertos, es mono ambiente, y cuenta con baño.\n\nCuenta con servicio de Electricidad. Estado de títulos: Escritura.\n\nLa propiedad tiene una muy buena proyección, con posibilidad de alquilar una unidad durante la temporada turística y teniendo la opción de anexar más unidades.\n\nNo deje de visitar este inmueble, interesante opción para quien busca realizar un cambio de vida.\n\n<strong>Precio de Venta: DÓLARES ESTADOUNIDENSES CIENTO CINCUENTAMIL (U$S 150.000.-). </strong>\n\nContacto:\n\nTel. 03544-15431582\n\nC.P.I. Esteban Urús.  M.P. 4448.\n\n&nbsp;', 'V18- Importante casa con cabaña en V. Cura Brochero.', '', 'inherit', 'closed', 'closed', '', '1217-autosave', '', '', '2016-12-16 10:45:09', '2016-12-16 13:45:09', '', 1217, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1217-autosave/', 0, 'revision', '', 0),
(1518, 1, '2017-01-12 20:42:22', '2017-01-12 23:42:22', 'Se vende terreno de 8.540 m2, con bajada exclusiva al río Panaholma, en una zona tranquila y segura, con una vista de las sierras increíble y con buen acceso.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nEl inmueble está ubicado a 23 km. aprox. de Villa Cura Brochero y a 5,5 Km. aprox. de la plaza principal del pueblo de Panaholma. En el lugar denominado Los Morteritos, pasando el Segundo Vado, es una caserío con más de 30 casas y cabañas. El terreno tiene una forma irregular (aunque cercana a un rectángulo) y suma una superficie de 8.540 m2. Todo el perímetro se encuentra alambrado. Se él se pueden hallar diversos árboles de especies autóctonas.\r\n\r\nCuenta con Electricidad, que ingresa en el terreno de forma subterránea, con la finalidad de no alterar el bello paisaje. También cuenta con una bomba de agua eléctrica, que realiza la extracción del río. La manguera está prolijamente disimulada y adherida con cemento y piedras, para que ninguna crecida la deteriore.\r\n\r\nTiene su propia bajada al río, con 133 metros de frente sobre el mismo. Debido a la altura con la que cuenta el terreno, las crecidas no han alcanzado su nivel.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEste inmueble es ideal para desarrollar un proyecto turístico como también la construcción de una vivienda, en un lugar donde se aprecia el contacto con la naturaleza y la tranquilidad y seguridad son características cotidianas. La bella vista de las Altas Cumbres, con el río a los pies, crean un ambiente paradisíaco!!!\r\n\r\n&nbsp;\r\n\r\nPrecio: DÓLARES ESTADOUNIDENSES CIENTO SESENTA MIL<strong> (U$S 160.000.-).</strong>\r\n\r\nCom. Inmob. 5%.\r\n\r\nContacto: C.P.I. Esteban Urús M.P. 4448\r\n\r\nTel: 03544-15-431582\r\n\r\nE-mail: info@/localhost/28._edificarinmobiliaria/', 'T26- Terreno único bajada al río Panaholma!!!!', '', 'publish', 'closed', 'closed', '', 't26-terreno-unico-bajada-rio-panaholma', '', '', '2018-01-23 19:07:46', '2018-01-23 22:07:46', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1518', 0, 'post', '', 0),
