(1535, 1, '2017-01-19 19:59:23', '2017-01-19 22:59:23', 'Se vende casa con living, cocina comedor, dos dormitorios  y dos baños en Mina Clavero!! Ubicada en barrio tranquilo.\r\n\r\nEste barrio se encuentra en la zona Sur de Mina Clavero; ha tenido un importante crecimiento en los últimos años con nuevas viviendas y complejos de cabañas. El nuevo Hospital Regional de Mina Clavero, se encuentra a 3 cuadras. Se encuentra a 170 mtrs. de la Ruta Provincial Nº14, y a 18 cuadras de la división de las Avenidas Mitre y San Martín, donde comienza el centro comercial de Mina Clavero.\r\n\r\nEl terreno es rectangular, con 10 metros de frente, con el mismo contrafrente por 31,35 metros de fondo, sumando aproximadamente 313 m2 de superficie.\r\n\r\nLa construcción, según plano es de 113,50 m2 de superficie. Está construida con materiales de buena calidad. Cuenta en Planta Baja con un pequeño living, cocina-comedor, un dormitorio con baño en suite y otro  baño con acceso desde la cocina. Desde allí también se accede mediante una escalera a la Planta Alta, en la que ingresamos a un segundo dormitorio, desde el que se accede a un balcón. Más cerca del frente tiene una cochera cerrada para un vehículo. Se encuentra en muy buen estado de conservación y con un prolijo cuidado del parque. La casa cuenta con servicios de Electricidad, Agua Potable de Red, Recolección de Residuos, (con opción a TV Cable, Teléfono e Internet).\r\n\r\nEstado de Títulos: Escritura de Dominio.\r\n\r\nUbicada en una zona tranquila, aunque cerca del río Los Sauces y con fácil acceso al centro es una interesante opción para disfrutar en vacaciones o como vivienda permanente.\r\n\r\n<strong>Precio de Venta: </strong>\r\n\r\n<strong>$ 1.550.000.- (PESOS UN MILLÓN QUINIENTOS CINCUENTAMIL). </strong>\r\n\r\nContacto:\r\n\r\nTel. 03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448.', 'V38- Casa en San Sebastián, M. Clavero.', '', 'draft', 'closed', 'closed', '', 'v38-casa-san-sebastian-clavero', '', '', '2018-01-17 12:57:10', '2018-01-17 15:57:10', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1535', 0, 'post', '', 0),
