(1544, 1, '2017-01-25 20:26:10', '2017-01-25 23:26:10', 'Se venden juntas o separadas dos fracciones de 1,4 Has. cada una, sumando entre ambas las 2,8 Has. aprox. A 450 metros se encuentra el río Panaholma, a 1,8km el “1er Vado” y a 2,1 Km. la plaza principal de Panaholma. Zona muy tranquila con hermosa vista panorámica.\r\n\r\n&nbsp;\r\n\r\nCon frente sobre un camino público que no cuenta con tanto tránsito, pasa por el frente la red de agua potable que abastece el pueblo y el tendido eléctrico. Las fracciones no son llanas, tienen un leve desnivel. Son aptas para un desarrollo turístico, o para una vivienda en un lugar tranquilo, con contacto con la naturaleza.\r\n\r\n&nbsp;\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias.\r\n\r\n&nbsp;\r\n\r\nEs una muy buena opción para construir una vivienda o unidades de alquiler dado su cercanía al río en un sector de playas con abundante arena. Panaholma ofrece paisajes y tranquilidad.\r\n\r\n<strong> </strong>\r\n\r\n<strong> </strong>\r\n\r\n<strong>Precio por las 2,8 Has: PESOS  UN MILLÓN CUATROCIENTOSMIL ($1.400.000.-)</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 3 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. Nº4448.\r\n\r\n<strong> </strong>', 'T27- Se venden 2,8 Has. en Panaholma.', '', 'draft', 'closed', 'closed', '', 't27-venden-has-panaholma', '', '', '2018-08-10 10:54:57', '2018-08-10 13:54:57', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1544', 0, 'post', '', 0),
