(1553, 1, '2017-01-26 10:42:30', '2017-01-26 13:42:30', 'El terreno está ubicado a 1.300 metros del asfalto en San Lorenzo, sobre camino consolidado que lleva a los reconocidos balnearios de Toro Muerto. Hermosa vista panorámica.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nTiene frente sobre el camino que une Mina Clavero y Villa Cura Brochero con los famosos balnearios ubicados sobre el arroyo “Toro Muerto”, a sólo 1.300 metros del asfalto y a 5,3 Km de V. Cura Brochero. El terreno es casi todo llano, con un leve desnivel descendiendo desde las sierras. Su forma es irregular, con más de 250 metros de frente sobre el mencionado camino. Suma una superficie de 9.000 m2 aproximadamente.\r\n\r\nEl servicio de Electricidad pasa por el frente (y en un sector por dentro de la fracción). Con respecto al  Agua, en esa zona se construyen cisternas que son llenadas por un camión de la Comuna y otra opción para acceder al agua sería realizando una perforación.\r\n\r\nEl inmueble se encuentra alambrado en todo su perímetro.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias. Respetado por todos sus vecinos, cumple perfectamente con requisitos para iniciar Usucapión.\r\n\r\n&nbsp;\r\n\r\nEn las cercanías hay un importante complejo de cabañas, y venta de artesanías.\r\n\r\n&nbsp;\r\n\r\nEs una muy buena opción para construir una vivienda o unidades de alquiler dado su cercanía a distintos balnearios, también, y dado su extenso frente, se puede ubicar un puesto de venta de artesanías, o varios para arrendar.\r\n\r\nBellas vistas serranas acompañadas de un clima y seguridad únicas!!\r\n\r\n<strong> </strong>\r\n\r\n<strong>Precio: PESOS SETECIENTOS VEINTEMIL ($720.000.-).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. Esteban Urús.\r\n\r\nMat. Nº4448.', 'T28 Fracción de 4.000 m2 aprox. en San Lorenzo.', '', 'publish', 'closed', 'closed', '', 't28-fraccion-000-aprox-san-lorenzo', '', '', '2018-09-13 20:02:23', '2018-09-13 23:02:23', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1553', 0, 'post', '', 0),
