(1562, 1, '2017-02-01 11:24:20', '2017-02-01 14:24:20', 'Se venden dos cabañas en Mina Clavero con excelentes posibilidades de alquiler. Amplio terreno, con piscina. Ubicadas en tranquilo barrio. Alquiler asegurado!!!\r\n\r\n&nbsp;\r\n\r\nLas dos unidades se encuentran en el tranquilo barrio “Solares de Villanueva  ll”, caracterizado por ser residencial, con viviendas de buena categoría y distintos emprendimientos relacionados con el hospedaje turístico. Se encuentran ubicadas a 500 metros del río Los Sauces y a 12 cuadras de la Av. Mitre. Está ubicada sobre dos terrenos que suman 1.292 m2. Cada unidad tiene cocina comedor, un dormitorio y el baño en planta baja. Subiendo por una escalera se accede al segundo dormitorio, que tiene una baranda hacia la cocina comedor por lo que no es totalmente cerrado. Cada cabaña cuenta con su propia cochera techada con parrilla. Cuenta con una piscina de 7 metros por 2,8 aproximadamente;  tiene su respectivo solárium.\r\n\r\nEste inmueble es óptimo para quien busque unidades de alquiler bien ubicadas, en muy buen estado de conservación.\r\n\r\nPrecio de venta: <strong>DÓLARES ESTADOUNIDENSES CIENTO CINCUENTA Y CINCOMIL. (U$S 155.000.-).</strong>\r\n\r\nCom. Inmob.: 3%.\r\n\r\nContacto: CPI Esteban Urús MP 4448.\r\n\r\nTel: 03544-15-431582', 'V39- Dos cabañas con piscina en Mina Clavero.', '', 'draft', 'closed', 'closed', '', 'v39-dos-cabanas-con-piscina-mina-clavero', '', '', '2017-05-10 09:43:36', '2017-05-10 12:43:36', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1562', 0, 'post', '', 0),
