(1572, 1, '2017-02-07 11:00:33', '2017-02-07 14:00:33', 'Se vende terreno de 519 m2 de superficie, en barrio tranquilo y consolidado de Mina Clavero. Ideal para una vivienda familiar.\r\n\r\nUbicado a 980 metros de la Av. Mitre y a 550 metros del río Los Sauces. El barrio es residencial, se caracteriza por viviendas familiares. El terreno es llano, sin superficies rocosas. Tiene el perímetro alambrado, excepto el frente. Con una forma rectangular, tiene un frente de 14,52 metros por igual contrafrente y en su lado Oeste 35,45 metros de fondo, y en el límite Este tiene 36,15 metros; sumando una superficie de 419,82 m2, cifras tomadas de la plancheta catastral.\r\n\r\nPosibilidad de conexión a Electricidad, Agua de red, recolección de residuos, internet, etc.\r\n\r\nTítulos: Escritura.\r\n\r\nEste terreno es una interesante opción para quién busque una opción en una zona desarrollada y con servicios.\r\n\r\n<strong>Precio: DÓLARES ESTADOUNIDENSES TREINTAMIL (U$S 30.000.-).</strong>\r\n\r\nComisión Inmob.:5%\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nCel: 03544-15-431582', 'T29 Terreno en Mina Clavero', '', 'draft', 'closed', 'closed', '', 't29-terreno-mina-clavero', '', '', '2018-08-15 19:19:30', '2018-08-15 22:19:30', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1572', 0, 'post', '', 0),
