(1589, 1, '2017-03-14 10:40:27', '2017-03-14 13:40:27', 'Se vende casa en Mina Clavero, ubicado a 200 metros del río Los Sauces. El terreno tiene 359 m2. Interesante opción con posibilidad de renta.\n\n&nbsp;\n\nEl barrio se caracteriza por un ambiente familiar conjuntamente con proyectos turísticos como cabañas y hosterías; enriquecido por su cercanía al río. El terreno tiene frente 12 metros aprox. por 30 metros aprox. de fondo, con una superficie de 359 m2. La calle del frente se encuentra asfaltada y a 450 metros de la Av. Mitre y la Terminal de Ómnibus.\n\nLa construcción data del año 2001 aproximadamente. Fue construida con materiales de muy buena calidad, y se encuentra en muy buen estado de conservación. Tiene una amplia cochera con parrilla, y en Planta Baja se ingresa a una amplia cocina comedor, muy luminosa; desde donde se accede a un baño. Subiendo las escaleras, se ingresa a la Planta Alta, que cuenta con un pasillo de distribución desde donde se ingresa a los dos dormitorios, a un segundo baño y al balcón que da al Norte, con vita al patio de la casa. Desde los dormitorios se puede salir al balcón que da al Sur, con vista a la calle. Entre la superficie cubierta y semi-cubierta, suma 119 m2. Cuenta con servicios de Agua de red, Electricidad, TV Cable, Recolección de Residuos, y factibilidad de Internet.\n\nEstado de títulos: Escritura.\n\nEl estado general de la vivienda es muy bueno, considerando que tiene aproximadamente 16 años de antigüedad; tiene una muy buena ubicación dada su cercanía al río y al centro comercial de Mina Clavero.\n\nPrecio: DOLARES CIENTO TREINTA Y CINCOMIL (U$S135.000.-).\n\nComisión Inmobiliaria: 3%\n\n03544-15431582\n\nC.P.I. Esteban Urús.\n\nM.P. 4448\n\n&nbsp;', 'V40- Importante casa de 2 dormitorios.', '', 'private', 'closed', 'closed', '', 'v40-importante-casa-dormitorios', '', '', '2019-01-26 18:59:02', '2019-01-26 21:59:02', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1589', 0, 'post', '', 0),
