(1598, 1, '2017-04-08 12:44:31', '2017-04-08 15:44:31', 'Se vende casa en Mina Clavero, ubicada a 60 metros de la Av. Mitre en Mina Clavero. El terreno tiene 814 m2. A 200 metros del río Los Sauces. Interesante opción con posibilidad de construir unidades de alquiler.\r\n\r\n&nbsp;\r\n\r\nEl barrio se caracteriza por un ambiente familiar conjuntamente con proyectos turísticos como cabañas y hosterías, y comercios de distinta índole sobre la Av. Mitre; enriquecido por su cercanía al río. El terreno tiene frente 18 metros aprox. de frente sobre calle asfaltada, suma una superficie de 814 m2 aprox.\r\n\r\nLa construcción fue construida con materiales de buena calidad, y se encuentra en buen estado de conservación en términos generales, aunque hay que realizarle arreglos y mejoras. Se ingresa a un comedor, unido a una pequeña cocina. Desde allí se accede a un baño y a dos dormitorios. También cuenta con un living con hogar a leña, un estar o escritorio y un tercer dormitorio. Suma 120 m2 cubiertos aproximadamente. Cuenta con servicios de Agua de red, Electricidad, TV Cable, Recolección de Residuos, y factibilidad de Internet.\r\n\r\nEstado de títulos: Consultar.\r\n\r\nEl estado general de la vivienda es bueno, considerando que  se le deben realizar mejoras, arreglos, pintura. Cuenta con una excelente ubicación dada su cercanía al río y al centro comercial de Mina Clavero.\r\n\r\nPrecio: DOLARES ESTADOUNIDENSES CIENTO VEINTICINCOMIL (U$S 125.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448\r\n\r\n&nbsp;', 'V41- Casa de 3 dormitorios. Excelente ubicación', '', 'publish', 'closed', 'closed', '', 'v41-casa-dormitorios-excelente-ubicacion', '', '', '2018-07-04 10:28:23', '2018-07-04 13:28:23', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1598', 0, 'post', '', 0),
