(1607, 1, '2017-07-04 19:36:51', '2017-07-04 22:36:51', 'Se vende terreno de 850 m2 aprox. de superficie, en barrio tranquilo y consolidado de Mina Clavero. Ideal para una vivienda familiar.\r\n\r\nUbicado a 320 metros de la Ruta Prov. Nº14, a 580 metros del río Los Sauces y a 1.100 metros del centro comercial de Mina Clavero. El barrio se caracteriza por viviendas familiares. En su misma cuadra se encuentra un Jardín de infantes. El terreno es llano, sin superficies rocosas. Tiene el perímetro alambrado, excepto el frente. Con una forma rectangular.  Tiene una superficie de 850 m2 aprox.\r\n\r\nPosibilidad de conexión a Electricidad, Agua de red, recolección de residuos, internet, etc.\r\n\r\nTítulos: Derechos y Acciones Posesorias.\r\n\r\nEste terreno es una interesante opción para quién busque una opción en una zona desarrollada y con servicios.\r\n\r\n<strong>Precio:  PESOS QUINIENTOS CINCUENTAMIL ($ 550.000.-).</strong>\r\n\r\nComisión Inmob.:5%\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nCel: 03544-15-431582', 'T31 Terreno en Mina Clavero', '', 'publish', 'closed', 'closed', '', 't31-terreno-mina-clavero', '', '', '2018-10-18 18:00:27', '2018-10-18 21:00:27', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1607', 0, 'post', '', 0),
