(1616, 1, '2017-07-14 11:53:08', '2017-07-14 14:53:08', 'La casa está ubicada a 1.300 metros del asfalto en San Lorenzo, sobre camino consolidado que lleva a los reconocidos balnearios de Toro Muerto. Hermosa vista panorámica y tranquilidad.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nTiene frente sobre el camino que une Mina Clavero y Villa Cura Brochero con los famosos balnearios ubicados sobre el arroyo “Toro Muerto”, a sólo 1.300 metros del asfalto y a 5,3 Km de V. Cura Brochero. El terreno es casi todo llano, con un leve desnivel descendiendo desde las sierras. Su forma es irregular, con frente sobre el mencionado camino. Suma una superficie de 1.215 m2 aproximadamente.\r\n\r\nLa casa es nueva, tiene un año de antigüedad, con 52 m2 cubiertos y 60 m2 semicubiertos, aproximadamente. Cuenta con cocina-comedor, un baño y un dormitorio. Amplias galerías con parrilla. Un pequeño galpón para guardar herramientas.\r\n\r\nTiene servicio de Electricidad. Con respecto al  Agua, en esa zona no hay agua de red, por lo que cuenta con tanques de agua que funcionan como cisterna que son llenadas por un camión de la Comuna.\r\n\r\nEl inmueble se encuentra alambrado en todo su perímetro.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias. Respetado por todos sus vecinos, cumple perfectamente con requisitos para iniciar Usucapión.\r\n\r\n&nbsp;\r\n\r\nSe puede sumar alguna unidad como cabaña para alquilar en temporada y también existe la posibilidad de  vender artesanías, ya que cuenta con un importante tránsito en verano.\r\n\r\n&nbsp;\r\n\r\nAproveche esta casa para disfrutar de vivir en un entorno natural, a pocos minutos del centro de Mina Clavero y Cura Brochero.\r\n\r\nBellas vistas serranas acompañadas de un clima y seguridad únicas!!\r\n\r\n<strong> </strong>\r\n\r\n<strong>Precio: PESOS NOVECIENTOSMIL ($900.000.-).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 3 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. Esteban Urús.\r\n\r\nMat. Nº4448.', 'T42 Casa de 1 dormitorio en San Lorenzo.', '', 'draft', 'closed', 'closed', '', 't42-casa-dormitorio-san-lorenzo', '', '', '2018-02-16 09:37:27', '2018-02-16 12:37:27', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1616', 0, 'post', '', 0),
