(1625, 1, '2017-07-15 11:16:21', '2017-07-15 14:16:21', 'Ubicado en Mina Clavero, a 300 metros de la Av. Mitre. Nº14 y a 500 metros del río Los Sauces. Cuenta con piscina y quincho. Interesante opción para quien busque un cambio de vida en zona tranquila de Traslasierra.\r\n\r\nLos departamentos se encuentran en un sector caracterizado por la actividad comercial y de alquiler temporario, con frente sobre calle Merlo, que se encuentra asfaltada. El terreno tiene una forma rectangular, con 12 metros de frente, el mismo contrafrente y 32,8 metros de fondo aproximadamente, sumando una superficie de 399 m2. Es llano, con tierra de buena calidad y se encuentra a un nivel más alto que la calle. En el mismo podemos encontrar árboles que generan una fresca sombra en los meses de alquiler. Tiene tres departamentos con cocina comedor, un dormitorio y un baño cada uno. Uno cuenta con dos dormitorios. Dos se encuentran en Planta Baja y dos en Planta Alta. En la parte trasera del terreno se encuentra un quincho y una piscina con equipo de filtrado. También un pequeño galpón para el guardar herramientas, etc. La totalidad de la construcción suma aproximadamente 170 m2. Queda espacio para estacionar vehículos en el interior. Todas las instalaciones se encuentran en muy buen estado de mantenimiento.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEste inmueble permite generar ingresos y vivir todo el año en un barrio tranquilo y muy cerca del centro, lo que permite moverse caminando en Mina Clavero! Su ubicación asegura un muy buen alquiler durante la temporada!!\r\n\r\n<strong>Precio: </strong><strong>DÓLARES ESTADOUNIDENSES CIENTO SETENTA Y CINCO MIL (U$S 175.000.-).</strong>\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nTel.:03544-15431582.\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús. M.P. 4448', 'N13- 4 Departamentos con piscina. Excelente ubicación.', '', 'publish', 'closed', 'closed', '', 'n13-departamentos-con-piscina-excelente-ubicacion', '', '', '2018-06-15 10:36:34', '2018-06-15 13:36:34', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1625', 0, 'post', '', 0),
