(1634, 1, '2017-08-01 11:24:10', '2017-08-01 14:24:10', 'Se vende casa en Mina Clavero, ubicado a 320 metros de la Av. Mitre y a 600 metros del río Los Sauces. El terreno tiene 3.700 m2 aprox. Interesante opción con posibilidad de renta.\r\n\r\n&nbsp;\r\n\r\nInmueble ubicado en barrio se caracteriza por un ambiente familiar conjuntamente con desarrollos turísticos como cabañas y hosterías. El terreno cuenta con frente a tres calles y suma una superficie de 3.700 m2 aprox.; totalizando 184 metros de frente aprox., de los cuales 78 metros cuentan con asfalto. El terreno es llano y con tierra,  sin sectores rocosos. Cuenta con una inigualable arboleda añosa, que genera una fresca sombra en verano, además de haber distintos árboles frutales. Todo el perímetro está delimitado. La construcción que se encuentra en muy buen estado de conservación, fue construida con materiales de muy buena calidad; supera los cincuenta años de antigüedad. Cuenta con galería, cocina comedor, un estar con hogar a leña, sala que se puede utilizar como escritorio o dormitorio, dos dormitorios más y un baño. El departamento, independiente de la casa tiene cochera techada, cocina comedor, un dormitorio y un baño. También tiene un depósito para guardar herramientas.\r\n\r\nCuenta con servicios de Agua de red, Electricidad, TV Cable, Recolección de Residuos, y factibilidad de Internet.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEl estado general de la vivienda es muy bueno; tiene una excelente ubicación dada su cercanía al río y al centro comercial de Mina Clavero, al que se puede acceder caminando recorriendo 300 metros aprox. Este inmueble cumple con los requisitos para realizar un desarrollo turístico. Ideal para quién desee realizar una inversión segura!!\r\n\r\nPrecio: Consultar\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V43- Casa de 2 dormitorios con depto. Amplio terreno!!!', '', 'publish', 'closed', 'closed', '', 'v43-casa-dormitorios-con-depto-amplio-terreno', '', '', '2017-08-01 11:24:10', '2017-08-01 14:24:10', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1634', 0, 'post', '', 0),
