(1643, 1, '2017-09-22 18:22:58', '2017-09-22 21:22:58', 'Se vende terreno de 843,30m2 aprox. de superficie, en barrio tranquilo, bellas vistas serranas. Ideal para una vivienda familiar.\r\n\r\nUbicado a 490 metros de la Ruta Prov. Nº14, y a 400 metros de la comuna de Los Hornillos. Y sus medidas son de frente 20 metros y al norte por calle Bannier por igual contra frente al sur, por 42,16 metros en su costado este y oeste. El barrio se caracteriza por viviendas familiares. Está cercado con alambres, y cuenta con árboles de distintas especies.\r\n\r\nPosibilidad de conexión a Electricidad, Agua de red, recolección de residuos, internet, etc.\r\n\r\nTítulos: Derechos y Acciones Posesorias.\r\n\r\nEste terreno es una interesante opción para quién busque una opción en una zona desarrollada y con servicios.\r\n\r\n<strong>Pesos: PESOS CUATROCIENTOSMIL ($ 400.000.-).</strong>\r\n\r\nComisión Inmob.:5%\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nCel.: 03544-15-431582', 'T32 Terreno en los Hornillos', '', 'publish', 'closed', 'closed', '', 't32-terreno-los-hornillos', '', '', '2018-09-15 10:55:32', '2018-09-15 13:55:32', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1643', 0, 'post', '', 0),
