(1652, 1, '2018-07-04 10:28:17', '2018-07-04 13:28:17', 'Se vende casa en Mina Clavero, ubicada a 60 metros de la Av. Mitre en Mina Clavero. El terreno tiene 814 m2. A 200 metros del río Los Sauces. Interesante opción con posibilidad de construir unidades de alquiler.\n\n&nbsp;\n\nEl barrio se caracteriza por un ambiente familiar conjuntamente con proyectos turísticos como cabañas y hosterías, y comercios de distinta índole sobre la Av. Mitre; enriquecido por su cercanía al río. El terreno tiene frente 18 metros aprox. de frente sobre calle asfaltada, suma una superficie de 814 m2 aprox.\n\nLa construcción fue construida con materiales de buena calidad, y se encuentra en buen estado de conservación en términos generales, aunque hay que realizarle arreglos y mejoras. Se ingresa a un comedor, unido a una pequeña cocina. Desde allí se accede a un baño y a dos dormitorios. También cuenta con un living con hogar a leña, un estar o escritorio y un tercer dormitorio. Suma 120 m2 cubiertos aproximadamente. Cuenta con servicios de Agua de red, Electricidad, TV Cable, Recolección de Residuos, y factibilidad de Internet.\n\nEstado de títulos: Consultar.\n\nEl estado general de la vivienda es bueno, considerando que  se le deben realizar mejoras, arreglos, pintura. Cuenta con una excelente ubicación dada su cercanía al río y al centro comercial de Mina Clavero.\n\nPrecio: DOLARES ESTADOUNIDENSES CIENTO VEINTICINCOMIL (U$S 125.000.-).\n\nComisión Inmobiliaria: 3%\n\n03544-15431582\n\nC.P.I. Esteban Urús.\n\nM.P. 4448\n\n&nbsp;', 'V41- Casa de 3 dormitorios. Excelente ubicación', '', 'inherit', 'closed', 'closed', '', '1598-autosave', '', '', '2018-07-04 10:28:17', '2018-07-04 13:28:17', '', 1598, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1598-autosave/', 0, 'revision', '', 0),
(1654, 1, '2017-12-19 12:21:54', '2017-12-19 15:21:54', 'Se vende casa con enorme proyección comercial en Cura Brochero, ubicada en el principal acceso con 12 metros de frente. Tránsito permanente todo el año!!\r\n\r\nEl barrio se caracteriza por haber tenido un cambio en los últimos años. Se han realizado construcciones de locales comerciales que trabajan todo el año. La nueva Oficina de la Dirección de Turismo de la Municipalidad de Villa Cura Brochero ha sido construida a media cuadra de este inmueble. La av. Belgrano es la vía de acceso más utilizada por los vecinos, turistas y autobuses que llegan a nuestra Villa, lo que le da un importante tránsito, más allá de la temporada turística. Este inmueble se encuentra a 600 metros aprox. del río Los Sauces y a 1.000 metros de la plaza principal de Villa Cura Brochero.\r\n\r\nEl terreno es rectangular, con un frente de 12 metros, con igual contrafrente, por 35 metros de fondo, generando una superficie de 420 m2 aprox. Es llano, sin superficies rocosas.\r\n\r\nCuenta con una casa con 168 m2 aprox.  según cedulón rentas. La distribución es: galería de acceso, se ingresa a un sector que actualmente es una biblioteca, unida a una amplia y cómoda sala de estar, desde donde se puede acceder a la cocina-comedor, a una sala de lectura (que puede tener otro uso), y a los tres dormitorios y el baño. Desde la cocina-comedor se puede ingresar a una luminosa galería cerrada. En el fondo del terreno hay un pequeño taller y un depósito de herramientas.\r\n\r\nLa casa es amplia y cómoda; muy luminosa y con excelente ventilación. Se encuentra en un excelente estado de mantenimiento, en el que se percibe la dedicación de los propietarios para tal fin.\r\n\r\nCuenta con servicios de Electricidad, TV Cable, Recolección de Residuos, teléfono fijo y factibilidad de Internet.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEs una excelente vivienda, con una interesante proyección comercial, dado el importante tránsito que tiene durante todo el año.\r\n\r\nPrecio: DÓLARES ESTADOUNIDENSES CIENTO NOVENTA Y OCHOMIL (U$S198.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V48- Casa sobre Av. Belgrano. Proyección comercial.', '', 'publish', 'closed', 'closed', '', 'v48-casa-sobre-belgrano-proyeccion-comercial', '', '', '2017-12-19 12:21:54', '2017-12-19 15:21:54', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1654', 0, 'post', '', 0),
