(1663, 1, '2017-12-26 19:28:00', '2017-12-26 22:28:00', 'Se vende terreno de 430 m2 aprox. de superficie, proyección comercial.\r\n\r\nEste terreno está ubicado a media cuadra de la Plaza central de Villa Cura Brochero, sobre calle Rivadavia, que está asfaltada. Esta calle tiene mucho tránsito todo el año, ya que es la que habitualmente se  recorre para ir hacia Mina Clavero. Entre casas históricas y locales comerciales, este sector ha ido tomando una fisonomía comercial en los últimos años.\r\n\r\nSus medidas son de  9,70 metros aprox. de frente y 8,55 metros aprox. en su contrafrente y con un fondo de 47 metros aprox. Sumando una superficie de 430 m2 aprox. El terreno es llano y con tierra, sin sectores rocosos.\r\n\r\nPosibilidad de conexión a Electricidad, Agua de red, recolección de residuos, internet, etc.\r\n\r\nTítulos: Escritura.\r\n\r\nEste terreno es una interesante opción para quién busque una opción en una zona comercial, ideal para proyectos relacionados con el sector turístico.\r\n\r\n<strong>Precio: PESOS OCHOCIENTOS CINCUENTAMIL ($ 850.000.-).</strong>\r\n\r\nComisión Inmob.:5%\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nCel.: 03544-15-431582', 'T33-Terreno a metros de plaza central en V. Cura Brochero!!', '', 'draft', 'closed', 'closed', '', 't33-terreno-metros-plaza-central-cura-brochero', '', '', '2018-04-11 18:10:28', '2018-04-11 21:10:28', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1663', 0, 'post', '', 0),
