(1672, 1, '2018-01-18 09:54:00', '2018-01-18 12:54:00', 'La casa se encuentra ubicada en Cura Brochero en El Barrio La Antigua, tiene tres años de antigüedad, cuenta con una cochera semicubierta, tres dormitorios, un baño, cocina comedor y pileta. La fracción tiene aproximadamente tiene 860 m2 y la casa tiene aproximadamente 100 m2. Es una interesante opción ya que el barrio es tranquilo y cuenta con una hermosa vista. La casa es amplia y cómoda; muy luminosa y con excelente ventilación. Se encuentra en un excelente estado de mantenimiento. También tiene un pequeño galpón para guardar herramientas, etc.\r\n\r\nCuenta con servicios de Electricidad, Agua de Red, Recolección de Residuos, y factibilidad de Internet.\r\n\r\nEstado de títulos: Consultar.\r\n\r\nPrecio: DÓLARES ESTADOUNIDENSES OCHENTA Y CINCO MIL (U$S 85.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V-50 Ubicada en Cura Brochero, con tres dormitorios.', '', 'draft', 'closed', 'closed', '', 'ubicada-cura-brochero-con-tres-dormitorios', '', '', '2018-09-12 19:16:08', '2018-09-12 22:16:08', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1672', 0, 'post', '', 0),
