(1681, 1, '2018-01-23 18:53:26', '2018-01-23 21:53:26', 'Se vende terreno de 8.540 m2, con bajada exclusiva al río Panaholma, en una zona tranquila y segura, con una vista de las sierras increíble y con buen acceso.\n\n&nbsp;\n\n&nbsp;\n\nEl inmueble está ubicado a 23 km. aprox. de Villa Cura Brochero y a 5,5 Km. aprox. de la plaza principal del pueblo de Panaholma. En el lugar denominado Los Morteritos, pasando el Segundo Vado, es una caserío con más de 30 casas y cabañas. El terreno tiene una forma irregular (aunque cercana a un rectángulo) y suma una superficie de 8.540 m2. Todo el perímetro se encuentra alambrado. Se él se pueden hallar diversos árboles de especies autóctonas.\n\nCuenta con Electricidad, que ingresa en el terreno de forma subterránea, con la finalidad de no alterar el bello paisaje. También cuenta con una bomba de agua eléctrica, que realiza la extracción del río. La manguera está prolijamente disimulada y adherida con cemento y piedras, para que ninguna crecida la deteriore.\n\nTiene su propia bajada al río, con 133 metros de frente sobre el mismo. Debido a la altura con la que cuenta el terreno, las crecidas no han alcanzado su nivel.\n\nEstado de títulos: Escritura.\n\nEste inmueble es ideal para desarrollar un proyecto turístico como también la construcción de una vivienda, en un lugar donde se aprecia el contacto con la naturaleza y la tranquilidad y seguridad son características cotidianas. La bella vista de las Altas Cumbres, con el río a los pies, crean un ambiente paradisíaco!!!\n\n&nbsp;\n\nPrecio: DÓLARES ESTADOUNIDENSES CIENTO CINCUENTA MIL<strong> (U$S 150.000.-).</strong>\n\nCom. Inmob. 5%.\n\nContacto: C.P.I. Esteban Urús M.P. 4448\n\nTel: 03544-15-431582\n\nE-mail: info@/localhost/28._edificarinmobiliaria/', 'T26- Terreno único bajada al río Panaholma!!!!', '', 'inherit', 'closed', 'closed', '', '1518-autosave', '', '', '2018-01-23 18:53:26', '2018-01-23 21:53:26', '', 1518, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1518-autosave/', 0, 'revision', '', 0);
