(1682, 1, '2018-02-28 12:52:01', '2018-02-28 15:52:01', 'Excelente ubicación. Construida con materiales de 1era categoría e inmejorable diseño. El estado de conservación y mantenimiento es perfecto!! Única!!\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nUbicada sobre el Bv. Hernán Cortés, asfaltado; en el barrio más categorizado de Mina Clavero, rodeada por casas de muy buena categoría y distintos emprendimientos de alojamiento turísticos.\r\n\r\nEl terreno es esquina, tiene un frente de 26 metros aprox. el Bv. Hernán Cortés y con 42 metros aprox. sobre calle Cura Brochero, con una forma rectangular irregular, suma una superficie de 1.522 m2, según plano.\r\n\r\nLa construcción realizada con materiales de excelente calidad, y se encuentra en impecable estado de conservación en términos generales, tiene una antigüedad de 28 años aproximadamente.\r\n\r\nDesde una cochera semicubierta para dos vehículos, con terraza sobre ella, se ingresa por un acceso secundario a la cocina, que bien puede utilizarse también como comedor para pocas personas. Desde allí se accede al comedor principal, amplio y luminoso, un desnivel lo separa del living, y subiendo 4 escalones nuevamente, accedemos a un cálido estar. Aquí tiene el acceso principal desde el exterior. Desde este salón de estar, se puede ingresar a un baño, pasando por un luminoso jardín de invierno. También desde allí se sube por una escalera caracol a un escritorio, que se encuentra en un primer piso. Cuenta con una bella baranda desde la que se observa el living, y tiene acceso a la amplia terraza, mediante una puerta balcón. Retornando al estar, allí comienza un amplio pasillo con piso de parquet, en excelente estado, en primera instancia se encuentra el acceso al dormitorio principal, amplio y luminoso. Tiene el baño, y en otro sector, una cómoda bañera, con un sector vidriado, que permite la vista del parque en el exterior. Continuando por el pasillo, se accede a dos dormitorios más, cada uno con una puerta balcón al exterior, cómodos y con placares, y a un tercer baño, también amplio.\r\n\r\nEn forma contigua a la casa, se encuentra un importante departamento. Se accede a un amplio estar comedor, unido a la cocina. Por una escalera caracol se sube al primer piso, donde se encuentra el dormitorio, desde donde se puede observar el Estar de planta baja. Desde el dormitorio se puede acceder a la amplia terraza y al baño, que cuenta con ante baño. Desde la terraza, se tiene una vista panorámica de las Altas Cumbres, y desde otro sector de la misma, se puede ver un sector más bajo de Mina Clavero. Entre superficie cubierta y semi cubierta, según plano, suma 317 m2.\r\n\r\nEn el sector interno del terreno se encuentra un departamento Monoambiente, con baño, es pequeño y funcional.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEl estado general de la vivienda es muy bueno/excelente, tiene una ubicación inmejorable, con una hermosa vista panorámica. Es un inmueble que ofrece distintas opciones, mantenerlo en su estado actual; y también modificarlo para convertirlo en un Petit Hotel, dadas sus dimensiones, desarrollar un restaurante, y todo tipo de proyectos relacionados con lo turístico.\r\n\r\nPrecio: Consultar\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V51- Excelente casa de 3 dormitorios, más dos Deptos.', '', 'publish', 'closed', 'closed', '', 'v51-excelente-casa-dormitorios-mas-dos-deptos', '', '', '2018-07-02 18:16:49', '2018-07-02 21:16:49', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1682', 0, 'post', '', 0),
