(1691, 1, '2018-04-26 18:26:39', '2018-04-26 21:26:39', 'Se vende terreno de 1.090 m2 aprox. de superficie, en barrio tranquilo y consolidado de Mina Clavero. Proyección comercial.\r\n\r\nUbicado a 670 metros de la división entre Av. Mitre y Av. San Martín. El barrio ha tenido un importante crecimiento en el último período, debido a que fue asfaltada la calle Olmos y se convirtió en una opción alternativa al Bv. de la Democracia (Ruta Prov. 14). Frente al terreno se encuentra un nuevo Complejo de Cabañas, y están funcionando nuevos negocios sobre esta calle, por lo antes mencionado, ha aumentado de manera importante el tránsito por su frente y su exposición.\r\n\r\nEl terreno es llano, sin superficies rocosas. Tiene el perímetro alambrado. Con una forma irregular, tiene un frente de 60 metros aproximadamente (cifras tomadas de la plancheta catastral), lo que le da una gran exposición.\r\n\r\nPosibilidad de conexión a Electricidad, Agua de red, recolección de residuos, internet, etc.\r\n\r\nTítulos: Consultar.\r\n\r\nEste terreno es una interesante opción para quién busque una opción en una zona desarrollada y con servicios.\r\n\r\n<strong>Precio: PESOS UN MILLÓN QUINIENTOS MIL ($ 1.500.000.-).</strong>\r\n\r\nComisión Inmob.:5%\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nCel: 03544-15-431582', 'T34 Terreno esquina en Mina Clavero', '', 'draft', 'closed', 'closed', '', 't34-terreno-esquina-mina-clavero', '', '', '2018-06-04 10:37:23', '2018-06-04 13:37:23', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1691', 0, 'post', '', 0),
