(1696, 1, '2018-05-08 17:47:32', '2018-05-08 20:47:32', 'Se vende terreno de 671.95 m2 aprox. de superficie, en barrio tranquilo y consolidado de Mina Clavero. Proyección comercial.\r\n\r\nUbicado a 950 metros de la Av. Mitre y a 250 metros del río Los Sauces. El barrio es residencial, se caracteriza por Complejos de cabañas, hoteles y viviendas familiares. El terreno es llano, sin superficies rocosas. Con una forma rectangular, tiene un frente de 20 metros aprox. por igual contrafrente y en sus laterales 33,40 metros aprox.; sumando una superficie de 671,95 m2 aprox., cifras tomadas de la plancheta catastral.\r\n\r\nPosibilidad de conexión a Electricidad, Agua de red, recolección de residuos, internet, etc.\r\n\r\nTítulos: Escritura.\r\n\r\nEste terreno es una interesante opción para quién busque una opción en una zona desarrollada y con servicios.\r\n\r\n<strong>Precio: DÓLARES ESTADOUNIDENSES CUARENTAMIL (U$S 40.000.-).</strong>\r\n\r\nComisión Inmob.:5%\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nCel: 03544-15-431582', 'T35 Terreno en Mina Clavero. Muy buena ubicación.', '', 'publish', 'closed', 'closed', '', 't34-terreno-mina-clavero-muy-buena-ubicacion', '', '', '2018-05-11 20:16:53', '2018-05-11 23:16:53', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1696', 0, 'post', '', 0),
