(1704, 1, '2018-05-11 20:15:31', '2018-05-11 23:15:31', 'Ubicado en Villa Cura Brochero, sobre la calle asfaltada 26 de Enero,  y a 300 metros del río Los Sauces. Interesante opción para quien busque un cambio de vida en zona con actividad comercial, en Villa Cura Brochero, Traslasierra.\r\n\r\nEl terreno es llano y tiene 12 metros de frente por 25 metros de fondo, sumando una superficie aprox.de 300 m2.\r\n\r\nEn el frente encontramos dos locales comerciales, cada uno con su baño. Uno de estos locales se encuentra azulejado. En la parte posterior de los locales hay una cocina, que se puede utilizar en forma compartida por quienes se hospeden en las habitaciones. Desde el frente también se accede por una galería semicubierta (que puede utilizarse como cochera) al patio interno. Desde allí se ingresa a las 3 habitaciones con baño que hay en la parte posterior del inmueble. Estas habitaciones cuentan con una galería. Por una escalera se accede al primer piso, desde donde se ingresa al departamento de un dormitorio y a las 3 habitaciones con baño que se encuentran en Planta Alta. Hay un balcón con vista a la calle. Todas las instalaciones se encuentran en muy buen estado de mantenimiento. Servicios de Agua de Red, Electricidad, TV Cable, Recolección de Residuos, con posibilidad de Internet y televisión satelital.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEste inmueble permite generar ingresos y vivir todo el año en un barrio tranquilo y muy cerca del centro. Es un barrio consolidado, cerca del centro comercial de Mina Clavero y Villa Cura Brochero!!\r\n\r\n<strong>Precio: </strong><strong>DÓLARES ESTADOUNIDENSES DOSCIENTOS TREINTAMIL (U$S 230.000.-).</strong>\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nTel.:03544-15431582.\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús. M.P. 4448', 'N15- Habitaciones con baño, un depto. y dos locales. Excelente opción de inversión!!', '', 'publish', 'closed', 'closed', '', 'n15-habitaciones-con-bano-depto-dos-locales-excelente-opcion-inversion', '', '', '2018-05-11 20:15:31', '2018-05-11 23:15:31', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1704', 0, 'post', '', 0),
