(1712, 1, '2018-12-21 10:43:43', '2018-12-21 13:43:43', 'Se venden casa y departamento ubicados en lote esquina sobre asfalto frente a la plaza de Panaholma, a 240 metros del río. Tranquilidad asegurada. Oportunidad para aprovechar!!\n\nLa casa y el depto. se encuentran frente a la plaza, donde hay algunos locales comerciales, la iglesia, policía, parada de ómnibus; todo enmarcado en la tranquilidad del pueblo serrano. El terreno esquina tiene 9 metros por 18 metros, sumando 160 m2 aproximadamente.\n\nCuenta con una casa y un departamento, que suman aproximadamente 87 m2 cubiertos; con la siguiente distribución: Casa: galería, parrilla, cocina-comedor, 2 dormitorios, baño. Departamento: parrilla, galería, cocina-comedor, un dormitorio y un baño. Ambas unidades cuentan con cocheras semi-cubiertas.\n\nCuenta con agua de red y electricidad. Estado de títulos: Consultar.\n\nEste inmueble es ideal para quien desee vivir en un lugar tranquilo, con contacto con la naturaleza, aunque con acceso a servicios y en una pequeña comunidad serrana. El río Panaholma da un marco único a este poblado, que cambia su perfil durante la temporada turística. También puede considerarse como vivienda de fin de semana con opción a alquilar la otra unidad. Ideal inversión como reserva de valor considerando su excelente ubicación.\n\nPrecio: <strong>DOLARES ESTADOUNIDENSES CUARENTA MIL. (U$S 40.000.-).</strong>\n\nContacto: C.P.I. Esteban Urús M.P. 4448\n\nTel: 03544-15-431582\n\nE-mail: info@/localhost/28._edificarinmobiliaria/\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;', 'V25- Casa y Depto. frente a plaza de Panaholma', '', 'inherit', 'closed', 'closed', '', '1311-autosave', '', '', '2018-12-21 10:43:43', '2018-12-21 13:43:43', '', 1311, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1311-autosave/', 0, 'revision', '', 0),
(1713, 1, '2018-06-04 10:38:59', '2018-06-04 13:38:59', 'La casa se encuentra ubicada en Cura Brochero en El Barrio La Antigua, tiene tres años de antigüedad, cuenta con una cochera semicubierta, tres dormitorios, un baño, cocina comedor y pileta. La fracción tiene aproximadamente tiene 860 m2 y la casa tiene aproximadamente 100 m2. Es una interesante opción ya que el barrio es tranquilo y cuenta con una hermosa vista. La casa es amplia y cómoda; muy luminosa y con excelente ventilación. Se encuentra en un excelente estado de mantenimiento. También tiene un pequeño galpón para guardar herramientas, etc.\n\nCuenta con servicios de Electricidad, Agua de Red, Recolección de Residuos, y factibilidad de Internet.\n\nEstado de títulos: Consultar.\n\nPrecio: DÓLARES ESTADOUNIDENSES OCHENTA Y CINCO MIL (U$S 85.000.-).\n\nComisión Inmobiliaria: 3%\n\n03544-15431582\n\nC.P.I. Esteban Urús.\n\nM.P. 4448', 'V-50 Ubicada en Cura Brochero, con tres dormitorios.', '', 'inherit', 'closed', 'closed', '', '1672-autosave', '', '', '2018-06-04 10:38:59', '2018-06-04 13:38:59', '', 1672, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1672-autosave/', 0, 'revision', '', 0),
(1714, 1, '2018-08-02 12:18:42', '2018-08-02 15:18:42', 'La casa está ubicada a 316 metros de la Av. Cura Brochero, asfaltada, con 2.272 m2 de terreno y 70 m2 cub. aprox.\r\n\r\n&nbsp;\r\n\r\nLa zona es tranquila, con estética rural y a 2.750  mtrs. aprox. de Villa Cura Brochero.\r\n\r\n&nbsp;\r\n\r\nLa fracción de terreno tiene forma rectangular, con 25 metros sobre un Pasaje Privado, por 89 metros de fondo. Suma 2.272 m2. Según el croquis, en la parte posterior de la fracción de terreno pasa un pequeño arroyo.\r\n\r\nLa casa tiene 70 m2 cub. aprox. y 24 m2 semicub.  aprox., cuenta con cocina, estar, un baño y dos dormitorios. Tiene una galería con detalles de terminación.\r\n\r\nTiene servicio de Electricidad.\r\n\r\n&nbsp;\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias.\r\n\r\n&nbsp;\r\n\r\nAproveche esta casa para disfrutar de vivir en un entorno natural, a pocos minutos del centro de Mina Clavero y Cura Brochero. Es una interesante opción para visitar.\r\n\r\n<strong> </strong>\r\n\r\n<strong>Precio: PESOS  UN MILLON NOVECIENTOSMIL ($1.900.000.-).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 3 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nCorr. Inmb. Esteban Urús.\r\n\r\nMat. Nº4448.', 'V52 Casa con 2  dormitorios en San Lorenzo, con pequeño arroyo cercano!', '', 'publish', 'closed', 'closed', '', 'v52-casa-con-dormitorios-san-lorenzo-con-pequeno-arroyo-cercano', '', '', '2018-08-23 17:42:11', '2018-08-23 20:42:11', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1714', 0, 'post', '', 0),
