(1723, 1, '2018-08-07 11:57:14', '2018-08-07 14:57:14', 'Se vende terreno de 325 m2 aprox. de superficie, en barrio tranquilo y en crecimiento. Ideal para vivienda permanente.\r\n\r\nUbicado a 200 metros de la  Ruta Prov. Nº14, a 850 metros del río Los Sauces, a 1.700 metros de la división de Av. Mitre y Av. San Martín y a 450 metros del nuevo Hospital de Mina Clavero. El barrio es residencial, se caracteriza por viviendas familiares. El terreno es llano, sin superficies rocosas. Tiene el perímetro alambrado. Con una forma rectangular, tiene un frente de 10 metros por igual contrafrente y en sus laterales tienen 32,50 metros de largo, sumando una superficie de 325 m2, cifras tomadas de la plancheta catastral.\r\n\r\nPosibilidad de conexión a Electricidad, Agua de red, recolección de residuos, internet, etc.\r\n\r\nTítulos: Escritura.\r\n\r\nEste terreno es una interesante opción para quién busque una opción en una zona desarrollada, con servicios y tranquila.\r\n\r\n<strong>Precio: PESOS QUINIENTOSMIL ($ 500.000.-).</strong>\r\n\r\nComisión Inmob.:5%\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nCel: 03544-15-431582', 'T37 Terreno en Mina Clavero, Bº San Sebastián', '', 'draft', 'closed', 'closed', '', 't37-terreno-mina-clavero-san-sebastian', '', '', '2018-10-13 12:12:25', '2018-10-13 15:12:25', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1723', 0, 'post', '', 0),
