(1732, 1, '2018-08-15 18:26:16', '2018-08-15 21:26:16', 'Se vende Complejo de cuatro cabañas, bien ubicado en Mina Clavero. Interesante opción para obtener renta con alquiler temporario o anual.\r\n\r\nEl complejo esta ubicado en Mina Clavero, en el tranquilo barrio de Villa Lujan, a unas 12 cuadras del centro y 4 del río Los Sauces, la zona se caracteriza por viviendas residenciales y desarrollos relacionados con la actividad turística. El complejo cuenta con 4 cabañas totalmente equipadas, listas para comenzar a trabajar, siendo dos cabañas de 2 dormitorios y las dos restantes de 1 dormitorio, todas con cocina comedor, baño y cochera. Cerco verde perimetral brinda intimidad al inmueble. Excelente estado de conservación y uso. Lote de 700m2 aproximadamente.\r\n\r\nConsulte para realizar una visita, es una muy buena opción para quién desee obtener ingresos de renta.\r\n\r\n<strong>Precio: DÓLARES ESTAUNIDENSES DOSCIENTOSMIL (U$S 200.000.-).</strong>\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nTel.:03544-15431582.\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús. M.P. 4448', 'N16 Cuatro Cabañas en Mina Clavero', '', 'publish', 'closed', 'closed', '', 'n16-cuatro-cabanas-mina-clavero', '', '', '2018-08-15 18:26:16', '2018-08-15 21:26:16', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1732', 0, 'post', '', 0),
