(1743, 1, '2018-09-17 19:55:46', '2018-09-17 22:55:46', 'Ubicado en San Lorenzo, a 280 metros de V. Cura Brochero, se encuentra este local comercial de 70 m2 aprox., tránsito todo el año, particularmente durante la temporada turística.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nEl terreno es rectangular y tiene una superficie de 200 m2 aprox., tiene un leve desnivel hacia el fondo del terreno, con tierra, sin superficies rocosas. Detrás del local se encuentra un depósito a terminar de 70 m2 aprox.\r\n\r\nActualmente el local está alquilado (ferretería), se vende en esa misma condición.\r\n\r\nLa construcción del local está en buen estado aunque se le puede realizar mantenimiento y mejoras. El depósito debe ser finalizado.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias.\r\n\r\nEste inmueble es una interesante opción para quien busque realizar un proyecto comercial, con posibilidades de renta.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<strong>Precio: U$S 63.000.- </strong><strong>(DÓLARES ESTADOUNIDENSES SESENTA Y TRESMIL).</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 3%\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nMat. Nº4448.', 'N17-  Local sobre asfalto San Lorenzo.', '', 'publish', 'closed', 'closed', '', 'n17-local-sobre-asfalto-san-lorenzo', '', '', '2018-09-17 19:55:46', '2018-09-17 22:55:46', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1743', 0, 'post', '', 0),
