(1758, 1, '2018-10-16 19:17:34', '2018-10-16 22:17:34', 'Se vende casa de dos dormitorios, con mínimos detalles por terminar en Mina Clavero!!\r\n\r\nEste barrio se encuentra en la zona Sur de Mina Clavero; ha tenido un importante crecimiento en los últimos años con nuevas viviendas y complejos de cabañas. El nuevo Hospital Regional de Mina Clavero, se encuentra a 4 cuadras. Se encuentra a 170 mtrs. de la Ruta Provincial Nº14, y a 17 cuadras de la división de las Avenidas Mitre y San Martín, donde comienza el centro comercial de Mina Clavero.\r\n\r\nEl terreno es rectangular, con 9,75 metros de frente por 32,50 metros de fondo, sumando aproximadamente 316,87 m2 de superficie.\r\n\r\nLa construcción de 54,25 m2 de superficie, tiene una antigüedad de 9 años aprox. Está construida con materiales de buena calidad. Cuenta con cocina-comedor, dos dormitorios y un baño. Se encuentra en muy buen estado de conservación. La casa cuenta con servicios de Electricidad, Agua Potable de Red, Recolección de Residuos, (con opción a TV Cable, Teléfono e Internet).\r\n\r\nEstado de Títulos: Escritura de Dominio.\r\n\r\nUbicada en una zona tranquila, aunque cerca del río Los Sauces y con fácil acceso al centro es una interesante opción para disfrutar en vacaciones o como vivienda permanente.\r\n\r\n<strong>Precio de Venta: </strong>\r\n\r\n<strong>U$S 88.000.- (DOLARES ESTADOUNIDENSES OCHENTA Y OCHOMIL). </strong>\r\n\r\nHonorarios Inmobiliarios 3%.\r\n\r\nContacto:\r\n\r\nTel. 03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448.', 'V53- Casa en Bº San Sebastián. M. Clavero.', '', 'publish', 'closed', 'closed', '', 'v53-casa-san-sebastian-clavero', '', '', '2018-10-18 11:58:12', '2018-10-18 14:58:12', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1758', 0, 'post', '', 0),
