(1767, 1, '2018-11-14 11:54:18', '2018-11-14 14:54:18', 'Se vende terreno de 400 m2 aprox. de superficie, muy buena ubicación, sobre asfalto! Ideal para una vivienda familiar.\r\n\r\nUbicado sobre la calle Mariano Moreno a metros de la Ruta Prov. Nº15, a 2 cuadras de la plaza de Cura Brochero, donde se encuentra el casco histórico del pueblo. El barrio se caracteriza por viviendas familiares, a pocos metros de una escuela primaria y el Dispensario Municipal. Sus medidas son de  12 metros de frente y contrafrente aprox. y con un fondo de 30 metros aprox. de un lado y al otro de 38 metros aprox., sumando aproximadamente 400 m2. Tiene asfalto en el frente. Cuenta con una construcción sin terminar, con paredes construidas sin finalizar. Posibilidad de conexión a Electricidad, Agua de red, recolección de residuos, internet, etc.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias.\r\n\r\nEste terreno es una interesante opción para quién busque una fracción de terreno en una zona desarrollada y con servicios.\r\n\r\n<strong>Precio: PESOS SEISCIENTOSMIL ($ 600.000.-).</strong>\r\n\r\nComisión Inmob.:5%\r\n\r\nC.P.I. Esteban Urús. M.P.4448.\r\n\r\nCel.: 03544-15-431582', 'T39 Terreno en V. Cura Brochero', '', 'publish', 'closed', 'closed', '', 't39-terreno-cura-brochero', '', '', '2018-11-14 11:54:18', '2018-11-14 14:54:18', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1767', 0, 'post', '', 0),
