(1773, 1, '2018-12-04 11:45:26', '2018-12-04 14:45:26', 'Se vende una fracción de terreno de 800 m2 aprox. en Panaholma, ubicado a 250 metros aprox. del río Panaholma, sobre camino público consolidado.\r\n\r\n&nbsp;\r\n\r\nCon frente sobre camino vecinal y frente al club del pueblo, a 1.400 metros aprox. del vado de Panaholma. Cada lote es rectangular, con 20 metros de frente (e igual contrafrente), por 40 metros de fondo, sumando 1.200 m2 de superficie.\r\n\r\nLa fracción es llana y sin superficies rocosas, con algunos árboles autóctonos, ideal para la forestación y la construcción.\r\n\r\nEl servicio de Electricidad pasa por el frente, al igual que el servicio de Agua Potable de Red suministrado por la comuna. Durante la temporada turística cuenta con recolección de residuos.\r\n\r\nEstado de Títulos: Derechos y Acciones Posesorias.\r\n\r\nEs una muy buena opción para construir una vivienda de fin de semana o permanente, ya que es una zona tranquila.\r\n\r\nCon una bella vista de las sierras, si busca tranquilidad, ésta es una excelente opción.\r\n\r\n<strong> </strong>\r\n\r\n<strong>Precio: PESOS CUATROCIENTOS VEINTEMIL ($420.000.-)</strong>\r\n\r\n&nbsp;\r\n\r\nComisión inmobiliaria: 5 %\r\n\r\n&nbsp;\r\n\r\nTel.03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n<ol start="4448">\r\n 	<li>P. Nº4448.</li>\r\n</ol>', 'T40- Terreno en cercanía Panaholma.', '', 'publish', 'closed', 'closed', '', 't40-terreno-cercania-panaholma', '', '', '2018-12-04 11:45:26', '2018-12-04 14:45:26', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1773', 0, 'post', '', 0),
