(1780, 1, '2018-12-11 11:11:35', '2018-12-11 14:11:35', 'Se vende Complejo de seis cabañas con piscina y vivienda principal en V. Cura Brochero. Un desnivel de terreno le otorga una impresionante vista panorámica de las Altas Cumbres y un sector del valle.\r\n\r\nEl complejo está ubicado en Villa Cura Brochero, en tranquilo barrio caracterizado por viviendas permanentes, otros desarrollos relacionados con el turismo, a sólo 130 metros del río Los Sauces, en un sector en el que cuenta con amplias playas de arena. Se encuentra a 20 cuadras de la plaza central de Villa Cura Brochero, con su casco histórico y comercial; y a 13 cuadras de la plaza central de Mina Clavero. El terreno en el que se encuentra tiene 1.600 m2 aproximadamente. Dispone de seis cabañas, con piscina con solárium, un salón de uso común, y una casa principal. Desde el acceso el terreno asciende, generando una bella vista panorámica de las altas cumbres y un sector Mina Clavero y el valle.\r\n\r\nEl estado de títulos son Derechos y Acciones Posesorios.\r\n\r\nCuenta con servicios de Electricidad, Agua Potable de Red, Recolección de Residuos, posibilidad de TV Cable e Internet.\r\n\r\nEste complejo de cabañas trabaja desde hace 14 años aproximadamente, se encuentran en muy buen estado de conservación, y listas para trabajar. Consulte para realizar una visita y conocer en detalle este inmueble, es una muy buena opción para quién desee obtener ingresos de renta.\r\n\r\n<strong>Precio: DÓLARES ESTAUNIDENSES TRESCIENTOS SESENTA Y CINCOMIL (U$S 365.000.-).</strong>\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nTel.:03544-15431582.\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús. M.P. 4448', 'N14- Cabañas en V. Cura Brochero. Bella vista panorámica.', '', 'publish', 'closed', 'closed', '', 'n14-cabanas-cura-brochero-bella-vista-panoramica', '', '', '2018-12-11 11:11:35', '2018-12-11 14:11:35', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1780', 0, 'post', '', 0),
