(1789, 1, '2018-12-26 19:28:58', '2018-12-26 22:28:58', 'Se vende casa a terminar en Mina Clavero, ubicada a 750 metros de la Av. Mitre, y a 10 cuadras del río Los Sauces. El terreno tiene 378 m2.\r\n\r\nEl barrio se caracteriza por un ambiente tranquilo y familiar. El terreno es llano y sin sectores rocosos. El pasaje del frente es sin salida, por lo que hay poco tránsito y mucha tranquilidad.\r\n\r\nLa construcción principal está sin terminar, tiene, sumando Planta Baja y Planta Alta unos 90 m2 cubiertos y 18 m2 semicubiertos. En Planta Baja tiene Cocina Comedor y un Baño, mientras en la Planta Alta tiene proyectado dos ambientes siendo un Escritorio y un Dormitorio. Fue construida con materiales de buena calidad.\r\n\r\nTambién y en forma independiente hay dos pequeñas construcciones, son dos habitaciones separadas, una de las cuales tiene baño.\r\n\r\nCuenta con servicios de Agua de red, Electricidad, TV Cable y factibilidad de Internet.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEs una interesante opción para terminar de construir una vivienda en un barrio tranquilo de Mina Clavero.\r\n\r\nPrecio: DOLARES ESTADOUNIDENSES SESENTA Y CINCOMIL (U$S65.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448\r\n\r\n&nbsp;', 'V54- Casa a terminar en Mina Clavero.', '', 'publish', 'closed', 'closed', '', 'v54-casa-terminar-mina-clavero', '', '', '2018-12-26 19:28:58', '2018-12-26 22:28:58', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1789', 0, 'post', '', 0),
