(1808, 1, '2019-01-16 12:54:28', '2019-01-16 15:54:28', 'Ubicado en Villa Cura Brochero, a sólo 100 metros de Av. Belgrano. Interesante opción para quien busque una inversión relacionada con el turismo, con posibilidades de desarrollar el negocio.\r\n\r\nEl terreno es llano, hace esquina entre calle Rivadavia y calle pública. Tiene 55 metros de frente aproximadamente, sumando una superficie aprox. de 820 m2. Cuenta con 167 m2 cubiertos aprox. y 167 m2 semicubiertos aprox. La construcción data del 2.013 aprox.\r\n\r\nPor el frente  de la construcción se accede a las ocho cocheras techadas, con piso de cemento, desde las que se ingresa a cada unidad. Cada unidad monoambiente tiene 19 m2 cubiertos, incluyendo el baño. Cada uno podría albergar para 2, 3 y hasta 4 personas. También tienen una salida posterior, por la que se accede a un pequeño patio propio con parrilla, brindando intimidad a cada pareja o familia. Se encuentra en muy buen estado de conservación. La estructura está preparada para construir en un primer piso.\r\n\r\nServicios de Agua Potable de Red, Electricidad, Recolección de Residuos, con posibilidad de Internet y televisión satelital o TV Cable.\r\n\r\nEstado de títulos: Consultar.\r\n\r\nEsta es una inversión para quien desee trabajar durante la temporada turística, en un proyecto con posibilidades de crecimiento, en una zona consolidada de V. Cura Brochero.\r\n\r\n<strong>Precio: </strong><strong>DÓLARES ESTADOUNIDENSES DOSCIENTOS DIEZMIL (U$S 210.000.-).</strong>\r\n\r\nComisión Inmobiliaria: 3%.\r\n\r\nTel.:03544-15431582.\r\n\r\nwww./localhost/28._edificarinmobiliaria/\r\n\r\nC.P.I. Esteban Urús. M.P. 4448', 'N12- Se vende hostería con 8 unidades monoambientes con cochera!!', '', 'publish', 'closed', 'closed', '', 'n12-vende-hosteria-con-unidades-monoambientes-con-cochera', '', '', '2019-01-16 12:54:28', '2019-01-16 15:54:28', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1808', 0, 'post', '', 0),
