(1817, 1, '2019-01-26 11:49:35', '0000-00-00 00:00:00', '<!-- wp:paragraph -->\n<p>C13- Se\nvenden 22 has. cercanas a Panaholma.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Se\nvenden 22 Has a 4,5 km del río Panaholma. Interesante opción para proyecto\nproductivo, en una zona tranquila. Bella vista de las sierras. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Se\nencuentra a 2 km. del acceso asfaltado a Panaholma, y a 16 Km. de Villa Cura\nBrochero.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La\nsuperficie es llana, con agradable paisaje, la zona es muy tranquila. Hay 6\nhas. aprox. con posibilidades de ser sembradas, y en el resto del campo hay\nmonte, no muy cerrado. El alambrado en general necesita mantenimiento. Cuenta\ncon una construcción de 77 m2 cubiertos aprox., esta necesita mejoras y la\nconstrucción de un baño nuevo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tiene\nun pozo de agua, que puede funcionar con molino o una bomba eléctrica, con\npantalla solar. No cuenta con tendido de electricidad, por lo que hay que\npensar en energías alternativas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Estado\nde títulos: Derechos y Acciones Posesorias. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Interesante\ninmueble para quien decida alejarse de las ciudades y emprenda una nueva vida\nen las sierras, considerando un proyecto productivo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br />\nPrecio de Venta: Consultar.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Comisión\nInmobiliaria: 3%.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contacto:\n03544-15431582.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>C.P.I.\nEsteban Urús.&nbsp; M.P. 4448</p>\n<!-- /wp:paragraph -->', '', '', 'draft', 'closed', 'open', '', '', '', '', '2019-01-26 11:49:35', '2019-01-26 14:49:35', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1817', 0, 'post', '', 0),
(1818, 1, '2019-01-26 11:56:07', '2019-01-26 14:56:07', 'Se venden 22 Has a 4,5 km del río Panaholma. Interesante opción para proyecto productivo, en una zona tranquila. Bella vista de las sierras.\r\n\r\nSe encuentra a 2 km. del acceso asfaltado a Panaholma, y a 16 Km. de Villa Cura Brochero.\r\n\r\nLa superficie es llana, con agradable paisaje, la zona es muy tranquila. Hay 6 has. aprox. con posibilidades de ser sembradas, y en el resto del campo hay monte, no muy cerrado. El alambrado en general necesita mantenimiento. Cuenta con una construcción de 77 m2 cubiertos aprox., esta necesita mejoras y la construcción de un baño nuevo.\r\n\r\nTiene un pozo de agua, que puede funcionar con molino o una bomba eléctrica, con pantalla solar. No cuenta con tendido de electricidad, por lo que hay que pensar en energías alternativas.\r\n\r\nEstado de títulos: Derechos y Acciones Posesorias.\r\n\r\nInteresante inmueble para quien decida alejarse de las ciudades y emprenda una nueva vida en las sierras, considerando un proyecto productivo.\r\n\r\nPrecio de Venta: Consultar.\r\nComisión Inmobiliaria: 3%.\r\nContacto: 03544-15431582.\r\nC.P.I. Esteban Urús.\r\nM.P. 4448', 'C13- Se venden 22 has. cercanas a Panaholma.', '', 'publish', 'closed', 'closed', '', 'c13-venden-has-cercanas-panaholma', '', '', '2019-04-17 14:57:56', '2019-04-17 17:57:56', '', 0, 'http:///localhost/28._edificarinmobiliaria//?p=1818', 0, 'post', '', 0),
