(1823, 1, '2019-01-26 19:00:33', '2019-01-26 22:00:33', 'Se vende casa en Mina Clavero, ubicado a 200 metros del río Los Sauces. El terreno tiene 359 m2. Interesante opción con posibilidad de renta.\n\n&nbsp;\n\nEl barrio se caracteriza por un ambiente familiar conjuntamente con proyectos turísticos como cabañas y hosterías; enriquecido por su cercanía al río. El terreno tiene frente 12 metros aprox. por 30 metros aprox. de fondo, con una superficie de 359 m2. La calle del frente se encuentra asfaltada y a 450 metros de la Av. Mitre y la Terminal de Ómnibus.\n\nLa construcción data del año 2001 aproximadamente. Fue construida con materiales de muy buena calidad, y se encuentra en muy buen estado de conservación. Tiene una amplia cochera con parrilla, y en Planta Baja se ingresa a una amplia cocina comedor, muy luminosa; desde donde se accede a un baño. Subiendo las escaleras, se ingresa a la Planta Alta, que cuenta con un pasillo de distribución desde donde se ingresa a los dos dormitorios, a un segundo baño y al balcón que da al Norte, con vita al patio de la casa. Desde los dormitorios se puede salir al balcón que da al Sur, con vista a la calle. Entre la superficie cubierta y semi-cubierta, suma 119 m2. Cuenta con servicios de Agua de red, Electricidad, TV Cable, Recolección de Residuos, y factibilidad de Internet.\n\nEstado de títulos: Escritura.\n\nEl estado general de la vivienda es muy bueno, considerando que tiene aproximadamente 16 años de antigüedad; tiene una muy buena ubicación dada su cercanía al río y al centro comercial de Mina Clavero.\n\nPrecio: DOLARES CIENTO TREINTA Y CINCOMIL (U$S135.000.-).\n\nComisión Inmobiliaria: 3%\n\n03544-15431582\n\nC.P.I. Esteban Urús.\n\nM.P. 4448\n\n&nbsp;', '', '', 'inherit', 'closed', 'closed', '', '1589-autosave-v1', '', '', '2019-01-26 19:00:33', '2019-01-26 22:00:33', '', 1589, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1589-autosave-v1/', 0, 'revision', '', 0),
(1824, 1, '2019-01-27 12:21:04', '2019-01-27 15:21:04', 'Se venden 22 Has a 4,5 km del río Panaholma. Interesante opción para proyecto productivo, en una zona tranquila. Bella vista de las sierras.\n\nSe encuentra a 2 km. del acceso asfaltado a Panaholma, y a 16 Km. de Villa Cura\nBrochero.\n\nLa superficie es llana, con agradable paisaje, la zona es muy tranquila. Hay 6 has. aprox. con posibilidades de ser sembradas, y en el resto del campo hay monte, no muy cerrado. El alambrado en general necesita mantenimiento. Cuenta con una construcción de 77 m2 cubiertos aprox., esta necesita mejoras y la construcción de un baño nuevo.\n\nTiene un pozo de agua, que puede funcionar con molino o una bomba eléctrica, con pantalla solar. No cuenta con tendido de electricidad, por lo que hay que pensar en energías alternativas.\n\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n\nEstado de títulos: Derechos y Acciones Posesorias.\n\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n\nInteresante\ninmueble para quien decida alejarse de las ciudades y emprenda una nueva vida\nen las sierras, considerando un proyecto productivo.\n\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n\nPrecio de Venta: Consultar.\n\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n\nComisión\nInmobiliaria: 3%.\n\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n\nContacto:\n03544-15431582.\n\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n\nC.P.I.\nEsteban Urús.  M.P. 4448\n\n<!-- /wp:paragraph -->', 'C13- Se venden 22 has. cercanas a Panaholma.', '', 'inherit', 'closed', 'closed', '', '1818-autosave-v1', '', '', '2019-01-27 12:21:04', '2019-01-27 15:21:04', '', 1818, 'http:///localhost/28._edificarinmobiliaria//blog/noticias/1818-autosave/', 0, 'revision', '', 0),
