(1832, 1, '2019-04-17 14:13:22', '2019-04-17 17:13:22', 'Se vende casa con depto. monoambiente en Mina Clavero, ubicada a 450 metros de la Av. Mitre, y a 10 cuadras del río Los Sauces. El terreno tiene 305 m2.\r\n\r\nEl barrio se caracteriza por un ambiente tranquilo y familiar. El terreno es llano. En el frente, sobre calle asfaltada, se encuentra un departamento Monoambiente, de unos 26 m2 aprox. En la parte posterior del terreno se encuentra la vivienda con cocina-comedor, dos dormitorios y un baño. La construcción necesita mantenimiento y mejoras. Cuenta con un segundo acceso a la vivienda, por un pasaje angosto, que sirve en forma peatonal o para bicicletas o motos, no para vehículos.\r\n\r\nCuenta con posibilidad de servicios de Agua de red, Electricidad, TV Cable y factibilidad de Internet.\r\n\r\nEstado de títulos: Escritura.\r\n\r\nEs un inmueble que una buena ubicación, sobre asfalto y cerca del centro. Ideal para vivienda permanente, cómodo y tranquilo.\r\n\r\nPrecio: PESOS DOS MILLONES CIENMIL ($ 2.100.000.-).\r\n\r\nComisión Inmobiliaria: 3%\r\n\r\n03544-15431582\r\n\r\nC.P.I. Esteban Urús.\r\n\r\nM.P. 4448', 'V55- Casa con Depto. en Mina Clavero.', '', 'inherit', 'closed', 'closed', '', '1798-revision', '', '', '2019-04-17 14:13:22', '2019-04-17 17:13:22', '', 1798, 'http://localhost/28._edificarinmobiliaria/blog/noticias/1798-revision/', 0, 'revision', '', 0),
